1),(97,4,'2014-11-13 00:03:26','Important: PayPal Users Must Discontinue Using SSL 3.0 By December 3, 2014','To address a vulnerability with the SSL 3.0 security protocol, PayPal and other payment gateways will be disabling SSL 3.0 support. Merchants must upgrade to Transport Layer Service (TLS) by December 3, 2014 to avoid PayPal payment operation failures. Learn more about what you need to do at https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/','https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/',0,1),(98,3,'2014-11-19 22:00:00','Welcome Store Credit and Refund 1.0 by aheadWorks!','Implement store credit functionality and inspire customers to make new purchases in your Magento store!','http://ecommerce.aheadworks.com/magento-extensions/store-credit-and-refund.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=scr_launch',0,0),(99,3,'2014-12-19 21:00:16','Unique Christmas Offer - up to 30% OFF + FREE 360-day support!','Don\'t miss a deal - get 25% off a single product and 30% off two or more products in cart. FREE 360-day support included! The offer is valid December 22-24!','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=pre_christmas_sale_2014',0,0),(100,3,'2014-12-18 19:30:33','Store Locator v.1.1.0 has been released!','With the updated Store Locator, you can upload tons of your physical store data in a flash and your customers can find the nearest location with your products in a second. ','http://ecommerce.aheadworks.com/magento-extensions/z-blocks.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=store_locator_1_1_0',0,0),(101,3,'2014-12-16 20:50:49','Add new shipping method with Personal Pickup ','Create a new pickup shipping method and let your clients select the nearest store where they can get their purchases themselves. ','http://ecommerce.aheadworks.com/magento-extensions/personal-pickup.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=personal_pickup1_0_0',0,0),(102,3,'2014-12-12 21:00:00','Z-Blocks v.2.5 has been released!','Manage, display, and target content blocks in a couple of clicks! Since version 2.5, you can rotate blocks content using AJAX, target blocks to certain referral visitors and much more.','http://ecommerce.aheadworks.com/magento-extensions/z-blocks.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=zblocks_25',0,0),(103,3,'2014-12-01 13:00:00','Cyber Monday Deal: Get a Year of Free Support with any Extension','Keep your online store up-to-date with any aheadWorks extension and get a free technical support the whole year round! The offer ends on December 3.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=cyber_monday_2014',0,0),(104,3,'2014-11-26 19:00:00','Black Friday Sale – 20% OFF all Magento extensions and themes!',' Enhance your store with new functionality at a reduced price! Valid till November 30.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=black_friday_2014',0,0),(105,3,'2014-11-24 20:00:00','Order Tags v.1.4 has been released!','Speed up order processing in your store! Since version 1.4, you can assign tags to orders of specific stores, change order row style and more.','http://ecommerce.aheadworks.com/magento-extensions/order-tags.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=order_tags14',0,0),(106,4,'2014-11-25 04:25:21','Magento Community Edition 1.9.1 is available!','Magento Community Edition 1.9.1 empowers merchants to deliver compelling shopping experiences by offering enhanced responsive design capabilities, new swatches to display product variations, and improved performance through support for MySQL 5.6 and PHP 5.5. It also includes support for Google Universal Analytics and over 70 product improvements. Find out more at http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download','http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download',0,0),(107,3,'2014-12-19 21:00:16','Unique Christmas Offer - up to 30% OFF + FREE 360-day support!','Don\'t miss a deal - get 25% off a single product and 30% off two or more products in cart. FREE 360-day support included! The offer is valid December 22-24!','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=christmasSale2014',0,0);
