INSERT INTO `catalog_product_entity_text` VALUES (1,4,72,0,1,'<p><strong>NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - CẦN THƠ (170km)</strong></p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa Du Kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng...</p>\r\n<p>&nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, đo&agrave;n đi qua G&ograve; Đen, Bến Lức, T&acirc;n An (tỉnh Long An), qu&ecirc; hương c&oacute; hai d&ograve;ng s&ocirc;ng V&agrave;m Cỏ Đ&ocirc;ng, V&agrave;m Cỏ T&acirc;y chảy qua, c&oacute; đặc sản rượu đế G&ograve; Đen, gạo n&agrave;ng Thơm Chợ Đ&agrave;o, thơm Bến Lức.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Tới th&agrave;nh phố Mỹ Tho (tỉnh Tiền Giang), du kh&aacute;ch tham quan v&ugrave;ng đất trứ danh của thời Nam Kỳ lục Tỉnh, c&ograve;n c&oacute; t&ecirc;n l&agrave; Mỹ Tho Đại Phố. Xuống đ&ograve; qua s&ocirc;ng Tiền, du kh&aacute;ch tham quan l&agrave;ng nghề truyền thống l&ograve; kẹo dừa, cơ sở nu&ocirc;i ong lấy mật...; đi xe ngựa tr&ecirc;n con lộ nhỏ uốn kh&uacute;c quanh co, ngắm những l&agrave;ng qu&ecirc; rợp b&oacute;ng dừa ở xứ Bến Tre; ngồi xuồng ch&egrave;o kh&aacute;m ph&aacute; cuộc sống s&ocirc;ng nước miền T&acirc;y. Xe đ&oacute;n v&agrave; tiếp tục đưa du kh&aacute;ch đi qua cầu Rạch Miễu - một c&ocirc;ng tr&igrave;nh mới ho&agrave;n th&agrave;nh của tỉnh Bến Tre.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi chiều, qua cầu Cần Thơ, đo&agrave;n tham quan nh&agrave; cổ B&igrave;nh Thủy, được x&acirc;y dựng từ năm 1870, kiến tr&uacute;c ti&ecirc;u biểu của Nam Bộ, nh&agrave; c&oacute; năm gian hai ch&aacute;i, sườn nh&agrave; bằng gỗ được chạm khắc tinh tế, đi&ecirc;u luyện, c&oacute; vườn lan v&agrave; c&acirc;y xương rồng 40 tuổi, c&ograve;n gọi l&agrave; \"Kim Lăng Trụ\", cao 8 thước, được x&aacute;c lập kỷ lục cao nhất Việt Nam.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi tối, xe đưa đo&agrave;n đi bến Ninh Kiều, nằm ở ng&atilde; ba s&ocirc;ng Hậu v&agrave; từng được mệnh danh l&agrave; đệ nhất danh thắng xứ T&acirc;y Đ&ocirc;, du kh&aacute;ch dạo chơi, thưởng thức c&agrave; ph&ecirc; ở c&aacute;c qu&aacute;n Thủy Tạ ven s&ocirc;ng. D&ugrave;ng bữa chiều với c&aacute;c m&oacute;n ăn Nam Bộ tr&ecirc;n du thuyền Cần Thơ v&agrave; lắng nghe những giai điệu ngọt ng&agrave;o của miền s&ocirc;ng nước.</p>\r\n<p>Sau đ&oacute;, Qu&yacute; kh&aacute;ch c&oacute; thể tự do đi dao chợ đ&ecirc;m T&acirc;y Đ&ocirc;, hoặc về khu đ&ocirc; thị mới C&aacute;i Khế, để kh&aacute;m ph&aacute; n&eacute;t nhộn nhịp, sầm uất của Cần Thơ về đ&ecirc;m. &nbsp;</p>\r\n<p>&nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NG&Agrave;Y 2: CẦN THƠ - S&Agrave;I G&Ograve;N (170km)&nbsp;</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, đo&agrave;n xuống đ&ograve; đi chợ nổi C&aacute;i Răng, theo c&aacute;c m&oacute;n h&agrave;ng treo tr&ecirc;n c&acirc;y ch&egrave;o bẻo ở đầu ghe, du kh&aacute;ch c&ugrave;ng mua b&aacute;n với kh&aacute;ch thương hồ miền t&acirc;y, t&igrave;m hiểu n&eacute;t văn h&oacute;a mua b&aacute;n tr&ecirc;n s&ocirc;ng rất đặc trưng của người Nam Bộ.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Tiếp tục xe đưa Qu&yacute; kh&aacute;ch đến vườn du lịch Mỹ Kh&aacute;nh, men theo những con đường nhỏ, du kh&aacute;ch dạo chơi trong một kh&ocirc;ng gian xanh của những vườn mận, xo&agrave;i, ch&ocirc;m ch&ocirc;m, m&iacute;t, sầu ri&ecirc;ng... Tham gia l&agrave;m b&aacute;nh tr&aacute;ng, nấu rượu đế, thưởng thức những m&oacute;n ngon rất d&acirc;n d&atilde; như c&aacute; l&oacute;c nướng ống tre, chuột quay lu, lẩu đồng qu&ecirc;... Sau đ&oacute; đo&agrave;n di chuyển qua tham quan Thiền viện Tr&uacute;c L&acirc;m Phương Nam - Thiền viện lớn v&agrave; đẹp nhất miền T&acirc;y Nam Bộ.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp; Buổi chiều, xe đưa đo&agrave;n đi qua cầu Cần Thơ (Th&agrave;nh phố Cần Thơ), cầu treo Mỹ Thuận (tỉnh Vĩnh Long) theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>&nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)</p>'),(2,4,73,0,1,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM</strong>&nbsp;:<strong></strong></p>\r\n<p>Xe đời mới c&oacute; m&aacute;y lạnh, v&eacute; t&agrave;u đ&ograve; du lịch đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh tour.</p>\r\n<div>&nbsp;</div>\r\n<p>Kh&aacute;ch sạn: Ph&ograve;ng 2 - 3 kh&aacute;ch, c&oacute; m&aacute;y lạnh, tivi, tủ lạnh, điện thoại, nước n&oacute;ng, vệ sinh ri&ecirc;ng.</p>\r\n<div>&nbsp;</div>\r\n<p><strong>Kh&aacute;ch sạn đạt chuẩn:&nbsp;</strong><em>&nbsp;HOLIDAY, HẬU GIANG</em><em>, T&Acirc;Y NAM, NINH KIỀU, PHƯƠNG Đ&Ocirc;NG</em><em>,&nbsp;</em><em>T&Acirc;Y Đ&Ocirc;.</em></p>\r\n<div>&nbsp;</div>\r\n<p><strong>Kh&aacute;ch sạn 4 sao&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;</strong><em>NINH KIỀU 2, GOLF 4 CẦN THƠ, VẠN PH&Aacute;T 1.</em></p>\r\n<div>&nbsp;</div>\r\n<p>(Hoặc c&aacute;c kh&aacute;ch sạn tương đương)</p>\r\n<div>&nbsp;</div>\r\n<p>Ăn uống gồm 3 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa v&agrave; chiều l&agrave; cơm phần 4 m&oacute;n, được đổi m&oacute;n thường xuy&ecirc;n theo ẩm thực địa phương. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ: 310.000 VNĐ</p>\r\n<div>&nbsp;</div>\r\n<p>Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.</p>\r\n<div>&nbsp;</div>\r\n<p>V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.</p>\r\n<div>&nbsp;</div>\r\n<p>Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).</p>\r\n<div>&nbsp;</div>\r\n<p>Qu&agrave; tặng, xổ số vui c&oacute; thưởng.</p>\r\n<div>&nbsp;</div>\r\n<p>Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.</p>\r\n<div>&nbsp;</div>\r\n<p><strong>GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM</strong>&nbsp;:</p>\r\n<div>&nbsp;</div>\r\n<p>C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.</p>\r\n<p>&nbsp;</p>\r\n<div><strong>GI&Aacute; V&Eacute; TRẺ EM</strong>:</div>\r\n<div>Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ&nbsp;được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;.</div>\r\n<div>&nbsp;</div>\r\n<p>(Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).</p>'),(3,4,83,0,1,NULL),(4,4,106,0,1,NULL),(5,4,72,0,2,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM :</strong><br />&nbsp;Xe đời mới c&oacute; m&aacute;y lạnh, v&eacute; t&agrave;u đ&ograve; du lịch, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh trong tour.<br />&nbsp;Ăn uống gồm 2 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa l&agrave; cơm phần 4 m&oacute;n.&nbsp;<br />&nbsp;Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.<br />&nbsp;V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.<br />&nbsp;Khăn lạnh, nước suối tr&ecirc;n đường (1 khăn, 1 chai/ ng&agrave;y).<br />&nbsp;Qu&agrave; tặng, xổ số vui c&oacute; thưởng.<br />&nbsp;Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000vnđ/trường hợp.<br /><strong><br />GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :</strong><br />Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.<br /><br /><strong>GI&Aacute; V&Eacute; TRẺ EM:&nbsp;</strong>&nbsp; &nbsp;<br />Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.<br />Trẻ em từ 06 đến 11 tuổi mua 2/3 v&eacute; tour: 500.000 VNĐ<br />Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 2/3 v&eacute;. (Ti&ecirc;u chuẩn 2/3 v&eacute;: được 01 suất ăn + 01 ghế ngồi)</p>'),(6,4,73,0,2,'<p><strong>Buổi s&aacute;ng: S&Agrave;I G&Ograve;N CAO L&Atilde;NH</strong>&nbsp;(162km)</p>\r\n<p>Xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, Chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng.</p>\r\n<p>Theo quốc lộ 1A, du kh&aacute;ch dừng ăn s&aacute;ng ở Mỹ Tho. Tới th&agrave;nh phố Cao L&atilde;nh, đo&agrave;n đi đ&ograve; v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng, Du kh&aacute;ch ngồi xuồng ba l&aacute;&nbsp; qua những lung sen thơm ng&aacute;t, v&ocirc; rừng tr&agrave;m nơi c&aacute;c lo&agrave;i chim c&ograve;, tr&iacute;ch, diệt, cồng cộc, le le, giang sen, cu xanh... tụ hội về kiếm ăn v&agrave; l&agrave;m tổ nằm trong khu thi&ecirc;n nhi&ecirc;n rộng 1.640ha thuộc Đồng Th&aacute;p Mười.</p>\r\n<p>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa trưa giữa một khung cảnh đồng qu&ecirc; y&ecirc;n tĩnh, c&oacute; những&nbsp; c&aacute;nh c&ograve;, tr&iacute;ch bay lượn xa xa, với c&aacute;c m&oacute;n ăn đặc sản ốc l&aacute;t hấp h&egrave;m, c&aacute; l&oacute;c nướng l&aacute; sen, g&agrave; x&eacute; phai, rau đồng luộc ăn với c&aacute; tr&ecirc; chi&ecirc;n mắm&nbsp; gừng...</p>\r\n<p><strong>Buổi chiều: CAO L&Atilde;NH SAĐ&Eacute;C S&Agrave;I G&Ograve;N</strong>&nbsp;(177km)</p>\r\n<p>Sau bữa ăn trưa ở khu du lịch G&aacute;o Giồng, đo&agrave;n đi Sa Đ&eacute;c viếng ch&ugrave;a Kiến An Cung, tham quan nh&agrave; cổ Huỳnh Thủy L&ecirc;, của một b&aacute; hộ ở Sa Đ&eacute;c xưa, nghe c&acirc;u chuyện t&igrave;nh l&atilde;ng mạn của chủ nh&acirc;n qua t&aacute;c phẩm \"Người T&igrave;nh\" (L\'Amant) do nữ văn sĩ Ph&aacute;p Marguerite Duras viết. Sau đ&oacute; tiếp tục gh&eacute; l&agrave;ng hoa kiểng T&acirc;n Quy Đ&ocirc;ng (l&agrave;ng hoa Sa Đ&eacute;c), du kh&aacute;ch thưởng ngoạn chụp ảnh với h&agrave;ng trăm lo&agrave;i \"kỳ hoa dị thảo\" trong một l&agrave;ng qu&ecirc; Nam Bộ với nghề truyền thống trồng hoa kiểng hơn 100 năm. &nbsp;</p>\r\n<p>Tr&ecirc;n đường về TP.Hồ Ch&iacute; Minh, du kh&aacute;ch gh&eacute; mua đặc sản Đồng Th&aacute;p như: nem Lai Vung, b&aacute;nh phồng t&ocirc;m Sa Giang, qu&yacute;t hồng...</p>\r\n<p>Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>(Ăn s&aacute;ng, trưa)</p>'),(7,4,137,0,2,'<p><strong>Buổi s&aacute;ng: S&Agrave;I G&Ograve;N CAO L&Atilde;NH</strong>&nbsp;(162km)</p>\r\n<p>Xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, Chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng.</p>\r\n<p>Theo quốc lộ 1A, du kh&aacute;ch dừng ăn s&aacute;ng ở Mỹ Tho. Tới th&agrave;nh phố Cao L&atilde;nh, đo&agrave;n đi đ&ograve; v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng, Du kh&aacute;ch ngồi xuồng ba l&aacute;&nbsp; qua những lung sen thơm ng&aacute;t, v&ocirc; rừng tr&agrave;m nơi c&aacute;c lo&agrave;i chim c&ograve;, tr&iacute;ch, diệt, cồng cộc, le le, giang sen, cu xanh... tụ hội về kiếm ăn v&agrave; l&agrave;m tổ nằm trong khu thi&ecirc;n nhi&ecirc;n rộng 1.640ha thuộc Đồng Th&aacute;p Mười.</p>\r\n<p>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa trưa giữa một khung cảnh đồng qu&ecirc; y&ecirc;n tĩnh, c&oacute; những&nbsp; c&aacute;nh c&ograve;, tr&iacute;ch bay lượn xa xa, với c&aacute;c m&oacute;n ăn đặc sản ốc l&aacute;t hấp h&egrave;m, c&aacute; l&oacute;c nướng l&aacute; sen, g&agrave; x&eacute; phai, rau đồng luộc ăn với c&aacute; tr&ecirc; chi&ecirc;n mắm&nbsp; gừng...</p>\r\n<p><strong>Buổi chiều: CAO L&Atilde;NH SAĐ&Eacute;C S&Agrave;I G&Ograve;N</strong>&nbsp;(177km)</p>\r\n<p>Sau bữa ăn trưa ở khu du lịch G&aacute;o Giồng, đo&agrave;n đi Sa Đ&eacute;c viếng ch&ugrave;a Kiến An Cung, tham quan nh&agrave; cổ Huỳnh Thủy L&ecirc;, của một b&aacute; hộ ở Sa Đ&eacute;c xưa, nghe c&acirc;u chuyện t&igrave;nh l&atilde;ng mạn của chủ nh&acirc;n qua t&aacute;c phẩm \"Người T&igrave;nh\" (L\'Amant) do nữ văn sĩ Ph&aacute;p Marguerite Duras viết. Sau đ&oacute; tiếp tục gh&eacute; l&agrave;ng hoa kiểng T&acirc;n Quy Đ&ocirc;ng (l&agrave;ng hoa Sa Đ&eacute;c), du kh&aacute;ch thưởng ngoạn chụp ảnh với h&agrave;ng trăm lo&agrave;i \"kỳ hoa dị thảo\" trong một l&agrave;ng qu&ecirc; Nam Bộ với nghề truyền thống trồng hoa kiểng hơn 100 năm. &nbsp;</p>\r\n<p>Tr&ecirc;n đường về TP.Hồ Ch&iacute; Minh, du kh&aacute;ch gh&eacute; mua đặc sản Đồng Th&aacute;p như: nem Lai Vung, b&aacute;nh phồng t&ocirc;m Sa Giang, qu&yacute;t hồng...</p>\r\n<p>Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>(Ăn s&aacute;ng, trưa)</p>'),(8,4,138,0,2,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM :</strong><br />&nbsp;Xe đời mới c&oacute; m&aacute;y lạnh, v&eacute; t&agrave;u đ&ograve; du lịch, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh trong tour.<br />&nbsp;Ăn uống gồm 2 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa l&agrave; cơm phần 4 m&oacute;n.&nbsp;<br />&nbsp;Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.<br />&nbsp;V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.<br />&nbsp;Khăn lạnh, nước suối tr&ecirc;n đường (1 khăn, 1 chai/ ng&agrave;y).<br />&nbsp;Qu&agrave; tặng, xổ số vui c&oacute; thưởng.<br />&nbsp;Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000vnđ/trường hợp.<br /><strong><br />GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :</strong><br />Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.<br /><br /><strong>GI&Aacute; V&Eacute; TRẺ EM:&nbsp;</strong>&nbsp; &nbsp;<br />Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.<br />Trẻ em từ 06 đến 11 tuổi mua 2/3 v&eacute; tour: 500.000 VNĐ<br />Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 2/3 v&eacute;. (Ti&ecirc;u chuẩn 2/3 v&eacute;: được 01 suất ăn + 01 ghế ngồi)</p>'),(9,4,83,0,2,NULL),(10,4,106,0,2,NULL),(13,4,72,0,3,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM :</strong><br /><br /><span>Xe đời mới c&oacute; m&aacute;y lạnh, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh tour.</span><br /><br /><span>Kh&aacute;ch sạn ti&ecirc;u chuẩn 2 sao đến 3 sao: Ph&ograve;ng 2 kh&aacute;ch, c&oacute; m&aacute;y lạnh, tivi, tủ lạnh, điện thoại, nước n&oacute;ng, vệ&nbsp; sinh ri&ecirc;ng.</span><br /><br /><span>Kh&aacute;ch sạn: S&Ocirc;NG TR&Agrave;, H&Ograve;A B&Igrave;NH, MỸ TR&Agrave;.</span><br /><br /><span>(hoặc c&aacute;c kh&aacute;ch sạn tương đương)</span><br /><br /><span>Ăn uống gồm 3 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa v&agrave; chiều l&agrave; cơm phần 4 m&oacute;n, được đổi</span><br /><br /><span>m&oacute;n thường xuy&ecirc;n theo ẩm thực địa phương. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ: 340.000 VNĐ.</span><br /><br /><span>Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.</span><br /><br /><span>V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.</span><br /><br /><span>Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).</span><br /><br /><span>Qu&agrave; tặng, xổ số vui c&oacute; thưởng.</span><br /><br /><span>Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.</span><br /><br /><strong>&nbsp;GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :</strong><br /><br /><span>C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.</span><br /><br /><span>Chi ph&iacute; c&acirc;u c&aacute;.</span><br /><br /><strong>GI&Aacute; V&Eacute; TRẺ EM:&nbsp;</strong><span>&nbsp;&nbsp; &nbsp;</span><br /><br /><span>-&nbsp;&nbsp;&nbsp; Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.</span><br /><br /><span>-&nbsp;&nbsp;&nbsp; Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.</span><br /><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp; Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;.</span><br /><br /><span>(Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).</span></p>'),(14,4,73,0,3,'<p><strong>NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - SA Đ&Eacute;C - CAO L&Atilde;NH - TR&Agrave;M CHIM (220km)</strong></p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh, nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, du kh&aacute;ch chinh phục cầu treo Mỹ Thuận, cảm nhận vẻ đẹp dịu d&agrave;ng n&ecirc;n thơ của d&ograve;ng s&ocirc;ng Tiền. Tiếp tục theo quốc lộ 80, đo&agrave;n ngang qua những vườn c&acirc;y ăn tr&aacute;i xum xu&ecirc; như vươn hẳn ra ven đường vẫy gọi du kh&aacute;ch phương xa.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đến thị x&atilde; Sa Đ&eacute;c, xứ sở phố thị miền s&ocirc;ng nước, &ecirc;m đềm nhưng kh&ocirc;ng k&eacute;m vui tươi. Du kh&aacute;ch sẽ tham quan ch&ugrave;a cổ Kiến An Cung của người Hoa, chỉ cần bước qua hai con k&igrave; l&acirc;n bằng đ&aacute; xanh v&agrave;o cửa, du kh&aacute;ch sẽ cảm nhận được sự thanh tao v&agrave; lộng lẫy của nơi n&agrave;y, mỗi chi tiết kiến tr&uacute;c đều thể hiện độ tinh xảo của nghệ nh&acirc;n. Những ho&agrave;nh phi c&acirc;u đối, v&agrave; h&igrave;nh tượng được khắc nổi đều chứa đựng những ẩn &yacute; th&acirc;m s&acirc;u tượng trưng cho niềm tin cuộc sống. Du kh&aacute;ch như xua tan hết mọi phiền n&atilde;o của đời thường khi chi&ecirc;m b&aacute;i trước Quan Th&aacute;nh Đế Qu&acirc;n tuy uy nghi&ecirc;m nhưng rất gần gũi v&agrave; thi&ecirc;ng li&ecirc;ng.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Rời ch&ugrave;a, du kh&aacute;ch sẽ đến với nh&agrave; cổ Huỳnh Thủy L&ecirc;, t&igrave;m hiểu kiến tr&uacute;c đặc sắc Đ&ocirc;ng - T&acirc;y h&ograve;a quyện, nghe thuyết minh về mối t&igrave;nh bất hủ giữa chủ nh&acirc;n ng&ocirc;i nh&agrave;, &ocirc;ng Huỳnh Thủy L&ecirc; (người Việt gốc Hoa) v&agrave; b&agrave; Marguerite Duras (người Ph&aacute;p). Chuyện t&igrave;nh l&atilde;ng mạn v&agrave; đẫm lệ n&agrave;y đ&atilde; được b&agrave; Marguerite kể lại trong cuốn tiểu thuyết Người T&igrave;nh, đ&atilde; dịch ra 43 thứ tiếng, sau đ&oacute; được chuyển thể th&agrave;nh bộ phim c&ugrave;ng t&ecirc;n Người T&igrave;nh, nổi tiếng khắp thế giới.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Du kh&aacute;ch sẽ tiếp tục kh&aacute;m ph&aacute; l&agrave;ng hoa T&acirc;n Quy Đ&ocirc;ng, vườn hoa lớn nhất v&ugrave;ng T&acirc;y Nam Bộ. Du kh&aacute;ch sẽ đi bộ ngắm cảnh v&agrave; chi&ecirc;m ngưỡng&nbsp; h&agrave;ng trăm lo&agrave;i \" kỳ hoa dị thảo\" đua nhau khoe sắc khắp v&ugrave;ng cũng như h&ograve;a m&igrave;nh v&agrave;o khung cảnh mua b&aacute;n tr&ecirc;n bến dưới thuyền của L&agrave;ng hoa.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Tiếp tục h&agrave;nh tr&igrave;nh xe đưa đo&agrave;n qua ph&agrave; Cao L&atilde;nh v&agrave;o th&agrave;nh phố Cao L&atilde;nh. Sau buổi cơm trưa, đo&agrave;n tham quan Vườn quốc gia Tr&agrave;m Chim Tam N&ocirc;ng, thuộc huyện Tam N&ocirc;ng, tỉnh Đồng Th&aacute;p.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đo&agrave;n sẽ c&oacute; dịp trải nghiệm cảm gi&aacute;c ch&ograve;ng ch&agrave;nh khi đi vỏ l&atilde;i lướt tr&ecirc;n s&oacute;ng nước xuy&ecirc;n những c&aacute;nh đồng l&uacute;a ma, xuy&ecirc;n rừng tr&agrave;m, xuy&ecirc;n những c&aacute;nh đồng Sen... Qu&yacute; kh&aacute;ch như h&ograve;a m&igrave;nh v&agrave;o thi&ecirc;n nhi&ecirc;n hoang d&atilde;, thỏa sức ngắm nh&igrave;n những sinh cảnh đặc biệt của Tr&agrave;m Chim theo m&ugrave;a như:</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Th&aacute;ng 9 - 10 l&agrave; m&ugrave;a chim đẻ trứng, du kh&aacute;ch sẽ ngắm những tổ chim lơ lững tr&ecirc;n những c&agrave;nh tr&agrave;m, chim mẹ mớm mồi, chim con tập bay...</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Th&aacute;ng 12 - 4 l&agrave; m&ugrave;a Sếu về: nếu may mắn Qu&yacute; kh&aacute;ch c&oacute; thể tận mắt thấy được Sếu Đầu Đỏ, lo&agrave;i chim thanh cao v&agrave; qu&yacute; hiếm nằm trong s&aacute;ch đỏ Việt Nam v&agrave; thế giới.</p>\r\n<p>-&nbsp;&nbsp; &nbsp;V&agrave; bất kỳ l&uacute;c n&agrave;o Qu&yacute; kh&aacute;ch cũng c&oacute; thể cảm nhận được m&ugrave;i của đồng qu&ecirc; với hoa tr&agrave;m, hoa s&uacute;ng, hoa sen; m&ugrave;i cỏ, m&ugrave;i năng, m&ugrave;i l&uacute;a ma...</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Bất kỳ nơi n&agrave;o Qu&yacute; kh&aacute;ch cũng được h&ograve;a m&igrave;nh v&agrave;o m&ocirc;i trường sống hoang d&atilde; của h&agrave;ng chục lo&agrave;i c&aacute; đồng, h&agrave;ng trăm lo&agrave;i chim trời v&agrave; động vật hoang d&atilde; nơi đ&acirc;y... thỏa sức ngắm nh&igrave;n từng đ&agrave;n chim tr&iacute;ch đua nhau ra bờ k&ecirc;nh t&igrave;m mồi; từng đ&agrave;n Nhan Sen, Quốc lặn ngụp dưới nước để bắt c&aacute; v&agrave; nhiều nhiều cảnh quan sinh động kh&aacute;c của cuộc sống hoang d&atilde; nơi đ&acirc;y.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch d&ugrave;ng buổi chiều tại thị trấn Tr&agrave;m Chim với c&aacute;c m&oacute;n ăn d&acirc;n d&atilde; đặc trưng theo m&ugrave;a của v&ugrave;ng Đồng Th&aacute;p Mười như: lẩu ch&aacute;o lươn, c&aacute; tr&ecirc; nướng mắm gừng, canh chua c&aacute; l&oacute;c đồng, đi&ecirc;n điển x&agrave;o t&eacute;p...</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đo&agrave;n về lại th&agrave;nh phố Cao L&atilde;nh nhận ph&ograve;ng nghỉ ngơi. Nghỉ đ&ecirc;m tại Cao L&atilde;nh.</p>\r\n<p>&nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NG&Agrave;Y 2: CAO L&Atilde;NH&nbsp; G&Aacute;O GIỒNG&nbsp; S&Agrave;I G&Ograve;N (196km)&nbsp;</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng: sau khi d&ugrave;ng điểm t&acirc;m s&aacute;ng v&agrave; l&agrave;m thủ tục trả ph&ograve;ng, xe đưa đo&agrave;n khởi h&agrave;nh v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng thuộc huyện Cao L&atilde;nh, tỉnh Đồng Th&aacute;p.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Xu&ocirc;i m&aacute;i ch&egrave;o tr&ecirc;n xuồng tam bản c&ugrave;ng c&aacute;c c&ocirc; g&aacute;i mặc &aacute;o b&agrave; ba xinh đẹp, du kh&aacute;ch tận hưởng khung cảnh chim trời c&aacute; nước m&ecirc;nh m&ocirc;ng, sen hồng phủ k&iacute;n mặt nước, rẽ từng cụm b&egrave;o c&aacute;m xanh ngắt len l&otilde;i tr&ecirc;n những con rạch nhỏ xuy&ecirc;n rừng tr&agrave;m v&agrave;o s&acirc;n chim, Qu&yacute; kh&aacute;ch sẽ tai nghe, mắt thấy h&agrave;ng trăm lo&agrave;i chim cư ngụ nơi đ&acirc;y. Du kh&aacute;ch sẽ l&ecirc;n đ&agrave;i quan s&aacute;t cao 18m, ngắm k&iacute;nh viễn vọng để cảm nhận một m&agrave;u xanh bất tận của rừng tr&agrave;m v&agrave; m&agrave;u trắng nhấp nh&ocirc; của h&agrave;ng ng&agrave;n con chim đủ loại đang sinh s&ocirc;i v&agrave; tr&uacute; ngụ nơi n&agrave;y.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Thỏa sức với một chuyến kh&aacute;m ph&aacute; căng sức, Du kh&aacute;ch c&oacute; thể nghỉ ngơi tr&ecirc;n những chiếc v&otilde;ng mắc tr&ecirc;n nh&agrave; s&agrave;n đu đưa bởi những cơn gi&oacute; đồng nội, xa xa l&agrave; rừng tr&agrave;m, l&agrave; đồng năng v&agrave; những đ&agrave;n tr&iacute;ch đang t&igrave;m mồi; hoặc du kh&aacute;ch vừa nghỉ ngơi vừa c&acirc;u c&aacute;, c&aacute;i th&uacute; d&acirc;n d&atilde; th&ocirc;n qu&ecirc; nhưng kh&ocirc;ng k&eacute;m phần hấp dẫn, nhất l&agrave; buổi trưa Qu&yacute; kh&aacute;ch c&oacute; thể tận hưởng những th&agrave;nh quả do m&igrave;nh c&acirc;u được th&igrave; c&ograve;n g&igrave; th&uacute; vị cho bằng. Qu&yacute; kh&aacute;ch dung buổi trưa với những m&oacute;n ăn miệt đồng theo m&ugrave;a như; c&aacute; l&oacute;c nướng trui cặp l&aacute; sen non chấm nước mắm me, c&aacute; r&ocirc; kho tộ, c&aacute; linh nấu chua cơm mẻ với b&ocirc;ng s&uacute;ng...</p>\r\n<p>&nbsp;&nbsp;&nbsp; Buổi chiều: rời G&aacute;o Giồng, rời Đồng Th&aacute;p Mười - miệt qu&ecirc; d&acirc;n d&atilde; đậm chất Miền T&acirc;y, xe đưa đo&agrave;n theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>&nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)</p>'),(15,4,137,0,3,'<p><strong>NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - SA Đ&Eacute;C - CAO L&Atilde;NH - TR&Agrave;M CHIM (220km)</strong></p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh, nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, du kh&aacute;ch chinh phục cầu treo Mỹ Thuận, cảm nhận vẻ đẹp dịu d&agrave;ng n&ecirc;n thơ của d&ograve;ng s&ocirc;ng Tiền. Tiếp tục theo quốc lộ 80, đo&agrave;n ngang qua những vườn c&acirc;y ăn tr&aacute;i xum xu&ecirc; như vươn hẳn ra ven đường vẫy gọi du kh&aacute;ch phương xa.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đến thị x&atilde; Sa Đ&eacute;c, xứ sở phố thị miền s&ocirc;ng nước, &ecirc;m đềm nhưng kh&ocirc;ng k&eacute;m vui tươi. Du kh&aacute;ch sẽ tham quan ch&ugrave;a cổ Kiến An Cung của người Hoa, chỉ cần bước qua hai con k&igrave; l&acirc;n bằng đ&aacute; xanh v&agrave;o cửa, du kh&aacute;ch sẽ cảm nhận được sự thanh tao v&agrave; lộng lẫy của nơi n&agrave;y, mỗi chi tiết kiến tr&uacute;c đều thể hiện độ tinh xảo của nghệ nh&acirc;n. Những ho&agrave;nh phi c&acirc;u đối, v&agrave; h&igrave;nh tượng được khắc nổi đều chứa đựng những ẩn &yacute; th&acirc;m s&acirc;u tượng trưng cho niềm tin cuộc sống. Du kh&aacute;ch như xua tan hết mọi phiền n&atilde;o của đời thường khi chi&ecirc;m b&aacute;i trước Quan Th&aacute;nh Đế Qu&acirc;n tuy uy nghi&ecirc;m nhưng rất gần gũi v&agrave; thi&ecirc;ng li&ecirc;ng.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Rời ch&ugrave;a, du kh&aacute;ch sẽ đến với nh&agrave; cổ Huỳnh Thủy L&ecirc;, t&igrave;m hiểu kiến tr&uacute;c đặc sắc Đ&ocirc;ng - T&acirc;y h&ograve;a quyện, nghe thuyết minh về mối t&igrave;nh bất hủ giữa chủ nh&acirc;n ng&ocirc;i nh&agrave;, &ocirc;ng Huỳnh Thủy L&ecirc; (người Việt gốc Hoa) v&agrave; b&agrave; Marguerite Duras (người Ph&aacute;p). Chuyện t&igrave;nh l&atilde;ng mạn v&agrave; đẫm lệ n&agrave;y đ&atilde; được b&agrave; Marguerite kể lại trong cuốn tiểu thuyết Người T&igrave;nh, đ&atilde; dịch ra 43 thứ tiếng, sau đ&oacute; được chuyển thể th&agrave;nh bộ phim c&ugrave;ng t&ecirc;n Người T&igrave;nh, nổi tiếng khắp thế giới.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Du kh&aacute;ch sẽ tiếp tục kh&aacute;m ph&aacute; l&agrave;ng hoa T&acirc;n Quy Đ&ocirc;ng, vườn hoa lớn nhất v&ugrave;ng T&acirc;y Nam Bộ. Du kh&aacute;ch sẽ đi bộ ngắm cảnh v&agrave; chi&ecirc;m ngưỡng&nbsp; h&agrave;ng trăm lo&agrave;i \" kỳ hoa dị thảo\" đua nhau khoe sắc khắp v&ugrave;ng cũng như h&ograve;a m&igrave;nh v&agrave;o khung cảnh mua b&aacute;n tr&ecirc;n bến dưới thuyền của L&agrave;ng hoa.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Tiếp tục h&agrave;nh tr&igrave;nh xe đưa đo&agrave;n qua ph&agrave; Cao L&atilde;nh v&agrave;o th&agrave;nh phố Cao L&atilde;nh. Sau buổi cơm trưa, đo&agrave;n tham quan Vườn quốc gia Tr&agrave;m Chim Tam N&ocirc;ng, thuộc huyện Tam N&ocirc;ng, tỉnh Đồng Th&aacute;p.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đo&agrave;n sẽ c&oacute; dịp trải nghiệm cảm gi&aacute;c ch&ograve;ng ch&agrave;nh khi đi vỏ l&atilde;i lướt tr&ecirc;n s&oacute;ng nước xuy&ecirc;n những c&aacute;nh đồng l&uacute;a ma, xuy&ecirc;n rừng tr&agrave;m, xuy&ecirc;n những c&aacute;nh đồng Sen... Qu&yacute; kh&aacute;ch như h&ograve;a m&igrave;nh v&agrave;o thi&ecirc;n nhi&ecirc;n hoang d&atilde;, thỏa sức ngắm nh&igrave;n những sinh cảnh đặc biệt của Tr&agrave;m Chim theo m&ugrave;a như:</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Th&aacute;ng 9 - 10 l&agrave; m&ugrave;a chim đẻ trứng, du kh&aacute;ch sẽ ngắm những tổ chim lơ lững tr&ecirc;n những c&agrave;nh tr&agrave;m, chim mẹ mớm mồi, chim con tập bay...</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Th&aacute;ng 12 - 4 l&agrave; m&ugrave;a Sếu về: nếu may mắn Qu&yacute; kh&aacute;ch c&oacute; thể tận mắt thấy được Sếu Đầu Đỏ, lo&agrave;i chim thanh cao v&agrave; qu&yacute; hiếm nằm trong s&aacute;ch đỏ Việt Nam v&agrave; thế giới.</p>\r\n<p>-&nbsp;&nbsp; &nbsp;V&agrave; bất kỳ l&uacute;c n&agrave;o Qu&yacute; kh&aacute;ch cũng c&oacute; thể cảm nhận được m&ugrave;i của đồng qu&ecirc; với hoa tr&agrave;m, hoa s&uacute;ng, hoa sen; m&ugrave;i cỏ, m&ugrave;i năng, m&ugrave;i l&uacute;a ma...</p>\r\n<p>-&nbsp;&nbsp; &nbsp;Bất kỳ nơi n&agrave;o Qu&yacute; kh&aacute;ch cũng được h&ograve;a m&igrave;nh v&agrave;o m&ocirc;i trường sống hoang d&atilde; của h&agrave;ng chục lo&agrave;i c&aacute; đồng, h&agrave;ng trăm lo&agrave;i chim trời v&agrave; động vật hoang d&atilde; nơi đ&acirc;y... thỏa sức ngắm nh&igrave;n từng đ&agrave;n chim tr&iacute;ch đua nhau ra bờ k&ecirc;nh t&igrave;m mồi; từng đ&agrave;n Nhan Sen, Quốc lặn ngụp dưới nước để bắt c&aacute; v&agrave; nhiều nhiều cảnh quan sinh động kh&aacute;c của cuộc sống hoang d&atilde; nơi đ&acirc;y.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch d&ugrave;ng buổi chiều tại thị trấn Tr&agrave;m Chim với c&aacute;c m&oacute;n ăn d&acirc;n d&atilde; đặc trưng theo m&ugrave;a của v&ugrave;ng Đồng Th&aacute;p Mười như: lẩu ch&aacute;o lươn, c&aacute; tr&ecirc; nướng mắm gừng, canh chua c&aacute; l&oacute;c đồng, đi&ecirc;n điển x&agrave;o t&eacute;p...</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đo&agrave;n về lại th&agrave;nh phố Cao L&atilde;nh nhận ph&ograve;ng nghỉ ngơi. Nghỉ đ&ecirc;m tại Cao L&atilde;nh.</p>\r\n<p>&nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NG&Agrave;Y 2: CAO L&Atilde;NH&nbsp; G&Aacute;O GIỒNG&nbsp; S&Agrave;I G&Ograve;N (196km)&nbsp;</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng: sau khi d&ugrave;ng điểm t&acirc;m s&aacute;ng v&agrave; l&agrave;m thủ tục trả ph&ograve;ng, xe đưa đo&agrave;n khởi h&agrave;nh v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng thuộc huyện Cao L&atilde;nh, tỉnh Đồng Th&aacute;p.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Xu&ocirc;i m&aacute;i ch&egrave;o tr&ecirc;n xuồng tam bản c&ugrave;ng c&aacute;c c&ocirc; g&aacute;i mặc &aacute;o b&agrave; ba xinh đẹp, du kh&aacute;ch tận hưởng khung cảnh chim trời c&aacute; nước m&ecirc;nh m&ocirc;ng, sen hồng phủ k&iacute;n mặt nước, rẽ từng cụm b&egrave;o c&aacute;m xanh ngắt len l&otilde;i tr&ecirc;n những con rạch nhỏ xuy&ecirc;n rừng tr&agrave;m v&agrave;o s&acirc;n chim, Qu&yacute; kh&aacute;ch sẽ tai nghe, mắt thấy h&agrave;ng trăm lo&agrave;i chim cư ngụ nơi đ&acirc;y. Du kh&aacute;ch sẽ l&ecirc;n đ&agrave;i quan s&aacute;t cao 18m, ngắm k&iacute;nh viễn vọng để cảm nhận một m&agrave;u xanh bất tận của rừng tr&agrave;m v&agrave; m&agrave;u trắng nhấp nh&ocirc; của h&agrave;ng ng&agrave;n con chim đủ loại đang sinh s&ocirc;i v&agrave; tr&uacute; ngụ nơi n&agrave;y.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Thỏa sức với một chuyến kh&aacute;m ph&aacute; căng sức, Du kh&aacute;ch c&oacute; thể nghỉ ngơi tr&ecirc;n những chiếc v&otilde;ng mắc tr&ecirc;n nh&agrave; s&agrave;n đu đưa bởi những cơn gi&oacute; đồng nội, xa xa l&agrave; rừng tr&agrave;m, l&agrave; đồng năng v&agrave; những đ&agrave;n tr&iacute;ch đang t&igrave;m mồi; hoặc du kh&aacute;ch vừa nghỉ ngơi vừa c&acirc;u c&aacute;, c&aacute;i th&uacute; d&acirc;n d&atilde; th&ocirc;n qu&ecirc; nhưng kh&ocirc;ng k&eacute;m phần hấp dẫn, nhất l&agrave; buổi trưa Qu&yacute; kh&aacute;ch c&oacute; thể tận hưởng những th&agrave;nh quả do m&igrave;nh c&acirc;u được th&igrave; c&ograve;n g&igrave; th&uacute; vị cho bằng. Qu&yacute; kh&aacute;ch dung buổi trưa với những m&oacute;n ăn miệt đồng theo m&ugrave;a như; c&aacute; l&oacute;c nướng trui cặp l&aacute; sen non chấm nước mắm me, c&aacute; r&ocirc; kho tộ, c&aacute; linh nấu chua cơm mẻ với b&ocirc;ng s&uacute;ng...</p>\r\n<p>&nbsp;&nbsp;&nbsp; Buổi chiều: rời G&aacute;o Giồng, rời Đồng Th&aacute;p Mười - miệt qu&ecirc; d&acirc;n d&atilde; đậm chất Miền T&acirc;y, xe đưa đo&agrave;n theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n.</p>\r\n<p>&nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>&nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)</p>'),(16,4,138,0,3,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM :</strong><br /><br /><span>Xe đời mới c&oacute; m&aacute;y lạnh, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh tour.</span><br /><br /><span>Kh&aacute;ch sạn ti&ecirc;u chuẩn 2 sao đến 3 sao: Ph&ograve;ng 2 kh&aacute;ch, c&oacute; m&aacute;y lạnh, tivi, tủ lạnh, điện thoại, nước n&oacute;ng, vệ&nbsp; sinh ri&ecirc;ng.</span><br /><br /><span>Kh&aacute;ch sạn: S&Ocirc;NG TR&Agrave;, H&Ograve;A B&Igrave;NH, MỸ TR&Agrave;.</span><br /><br /><span>(hoặc c&aacute;c kh&aacute;ch sạn tương đương)</span><br /><br /><span>Ăn uống gồm 3 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa v&agrave; chiều l&agrave; cơm phần 4 m&oacute;n, được đổi</span><br /><br /><span>m&oacute;n thường xuy&ecirc;n theo ẩm thực địa phương. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ: 340.000 VNĐ.</span><br /><br /><span>Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.</span><br /><br /><span>V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.</span><br /><br /><span>Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).</span><br /><br /><span>Qu&agrave; tặng, xổ số vui c&oacute; thưởng.</span><br /><br /><span>Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.</span><br /><br /><strong>&nbsp;GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :</strong><br /><br /><span>C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.</span><br /><br /><span>Chi ph&iacute; c&acirc;u c&aacute;.</span><br /><br /><strong>GI&Aacute; V&Eacute; TRẺ EM:&nbsp;</strong><span>&nbsp;&nbsp; &nbsp;</span><br /><br /><span>-&nbsp;&nbsp;&nbsp; Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.</span><br /><br /><span>-&nbsp;&nbsp;&nbsp; Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.</span><br /><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp; Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;.</span><br /><br /><span>(Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).</span></p>'),(17,4,83,0,3,NULL),(18,4,106,0,3,NULL),(39,4,72,0,4,'<p><strong>GI&Aacute; V&Eacute; BAO GỒM :</strong><br /><span>Xe đời mới c&oacute; m&aacute;y lạnh, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh trong tour.</span><br /><span>Ăn uống theo chương tr&igrave;nh. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ lại: 150.000 VNĐ</span><br /><span>Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.</span><br /><span>V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.</span><br /><span>Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).</span><br /><span>Qu&agrave; tặng, xổ số vui c&oacute; thưởng.</span><br /><span>Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.</span><br /><br /><strong>GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :</strong><br /><span>Ghế, d&ugrave;, tắm nước ngọt.</span><br /><span>Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; tr&ecirc;n biển.</span><br /><br /><strong>GI&Aacute; V&Eacute; TRẺ EM:&nbsp;&nbsp;&nbsp;</strong><span>&nbsp;</span><br /><span>Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute; .</span><br /><span>Trẻ em từ 06 đến 11 tuổi mua 2/3 v&eacute;.</span><br /><span>Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 2/3 v&eacute;. (Ti&ecirc;u chuẩn 2/3 v&eacute;: được 01 suất ăn + 01 ghế ngồi).</span></p>'),(40,4,73,0,4,'<p><strong>BUỔI S&Aacute;NG: S&Agrave;I G&Ograve;N - VŨNG T&Agrave;U</strong></p>\r\n<p>&nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, xe đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, L&ecirc; Duẩn, Đồng Khởi, Bạch Đằng, Nguyễn Hữu Cảnh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n... Đo&agrave;n ăn s&aacute;ng tại qu&aacute;n cơm tấm Thuận Kiều. Đến Vũng T&agrave;u, Qu&yacute; kh&aacute;ch vui chơi tắm biển tại khu du lịch Biển Đ&ocirc;ng b&atilde;i Th&ugrave;y V&acirc;n (b&atilde;i sau).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>BUỔI CHIỀU: VŨNG T&Agrave;U&nbsp; S&Agrave;I G&Ograve;N</strong></p>\r\n<p>&nbsp;&nbsp; &nbsp;Xe đưa đo&agrave;n đi theo con đường ven biển, qua b&atilde;i D&acirc;u, b&atilde;i Tầm Dương (b&atilde;i trước), Qu&yacute; kh&aacute;ch thưởng ngoạn phong cảnh n&ecirc;n thơ hữu t&igrave;nh của th&agrave;nh phố biển Vũng T&agrave;u, với 2 ngọn n&uacute;i lớn, n&uacute;i nhỏ kề b&ecirc;n biển. Tham quan Bạch Dinh, ngắm cảnh H&ograve;n B&agrave;. Đo&agrave;n dừng ở mũi Nghinh Phong chụp h&igrave;nh lưu niệm, ngắm tượng ch&uacute;a Gi&ecirc;su.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Đo&agrave;n tiếp tục viếng Đại T&ugrave;ng L&acirc;m, gh&eacute; chợ B&agrave; Rịa mua đặc sản biển, v&agrave; khu b&ograve; sữa Long Th&agrave;nh mua c&aacute;c sản phẩm được l&agrave;m từ sữa b&ograve; tươi nguy&ecirc;n chất.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Sau đ&oacute; đo&agrave;n khởi h&agrave;nh về TP.Hồ Ch&iacute; Minh theo cung đường Ng&atilde; ba C&aacute;t L&aacute;i - hầm Thủ Thi&ecirc;m, hầm vượt s&ocirc;ng d&agrave;i nhất Đ&ocirc;ng Nam &Aacute;.</p>\r\n<p>&nbsp;&nbsp; &nbsp;Về đến TP.Hồ Ch&iacute; Minh chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>&nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa)</p>'),(41,4,137,0,4,NULL),(42,4,138,0,4,NULL),(43,4,83,0,4,NULL),(44,4,106,0,4,NULL),(45,4,72,0,5,'<p><strong>NG&Agrave;Y 1 :&nbsp;&nbsp; S&Agrave;I G&Ograve;N - Đ&Agrave; LẠT&nbsp; (300 Km)</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, xe đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, L&ecirc; Duẩn, Đồng Khởi, Bạch Đằng, Nguyễn Hữu Cảnh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n... Đến Th&agrave;nh phố Bảo Lộc - xứ sở của tr&agrave; v&agrave; c&agrave; ph&ecirc;, Qu&yacute; kh&aacute;ch d&ugrave;ng cơm trưa.&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Đo&agrave;n tiếp tục h&agrave;nh tr&igrave;nh đến địa phận huyện Đức Trọng xe đưa Qu&yacute; kh&aacute;ch v&agrave;o tham quan th&aacute;c Pongour hay c&ograve;n gọi l&agrave; th&aacute;c Bảy Tầng hoặc th&aacute;c Thi&ecirc;n Thai - l&agrave; một trong những ngọn th&aacute;c đẹp, hoang sơ v&agrave; h&ugrave;ng vỹ nhất khu vực Nam T&acirc;y Nguy&ecirc;n.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, đến Đ&agrave; Lạt, về kh&aacute;ch sạn Qu&yacute; kh&aacute;ch nhận ph&ograve;ng.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi tối, Qu&yacute; kh&aacute;ch đi dạo Đ&agrave; Lạt về đ&ecirc;m, thưởng thức c&aacute;c m&oacute;n ngon ở chợ đ&ecirc;m &Acirc;m Phủ, hương vị c&agrave; ph&ecirc; phố n&uacute;i ở qu&aacute;n Thủy Tạ, ngắm cảnh Hồ Xu&acirc;n Hương, nghỉ đ&ecirc;m tại Đ&agrave; Lạt.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p><strong>NG&Agrave;Y 2 : Đ&Agrave; LẠT - C&Aacute;C THẮNG CẢNH</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, đo&agrave;n khởi h&agrave;nh đi tham quan L&agrave;ng hoa Th&aacute;i Phi&ecirc;n - một trong 3 l&agrave;ng nghề truyền thống trồng hoa nổi tiếng xứ cao nguy&ecirc;n, đến đ&acirc;y Qu&yacute; kh&aacute;ch kh&ocirc;ng chỉ được thỏa sức ngắm nh&igrave;n kh&ocirc;ng gian rực rỡ sắc hoa m&agrave; c&ograve;n c&oacute; thể quan s&aacute;t hoạt động canh t&aacute;c của c&aacute;c nghệ nh&acirc;n: người ươm giống, trồng c&acirc;y, chăm b&oacute;n, người thu h&aacute;i, bao g&oacute;i, đ&oacute;ng th&ugrave;ng sản phẩm; một kh&ocirc;ng gian thực m&agrave; rất thi vị.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Tiếp tục đo&agrave;n đến tham quan Hồ Than Thở - nơi lưu dấu những địa danh l&atilde;ng mạn như: Đồi Th&ocirc;ng Hai Mộ, C&acirc;y Th&ocirc;ng T&igrave;nh Y&ecirc;u... để minh chứng cho t&igrave;nh y&ecirc;u bất diệt d&ugrave; đượm buồn nhưng son sắc thủy chung, đến đ&acirc;y Qu&yacute; kh&aacute;ch kh&ocirc;ng chỉ được tham quan những Di t&iacute;ch t&igrave;nh y&ecirc;u, những thắng cảnh thi&ecirc;n nhi&ecirc;n xinh đẹp m&agrave; c&ograve;n được nghe kể v&agrave; trải l&ograve;ng với những giai thoại, những chuyện t&igrave;nh l&acirc;m ly son sắc; sau đ&oacute; Qu&yacute; kh&aacute;ch di chuyển v&agrave;o Trang trại d&acirc;u Biofresh tham quan v&agrave; trải nghiệm phương thức trồng d&acirc;u mới theo c&ocirc;ng nghệ Ph&aacute;p, d&acirc;u trồng tr&ecirc;n gi&aacute; thể c&aacute;ch mặt đất 1m v&agrave; được chăm s&oacute;c theo quy tr&igrave;nh ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u cam kết kh&ocirc;ng sử thuốc trừ s&acirc;u bệnh độc hại. Tr&ecirc;n đường về nh&agrave; h&agrave;ng d&ugrave;ng cơm trưa, Qu&yacute; kh&aacute;ch dừng tham quan v&agrave; ngắm Rừng hoa kh&ocirc; - showroom hoa tươi bảo quản nghệ thuật lớn nhất Việt Nam.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, Qu&yacute; kh&aacute;ch tham quan Ph&acirc;n viện Sinh Học Đ&agrave; Lạt - nơi được xem như l&agrave; bảo t&agrave;ng của c&aacute;c lo&agrave;i động thực vật qu&yacute; hiếm. Đến đ&acirc;y Qu&yacute; kh&aacute;ch sẽ được thỏa ch&iacute; tham quan v&agrave; t&igrave;m hiểu về hệ thống động thực vật của v&ugrave;ng đất cao nguy&ecirc;n với hơn 900 chậu địa lan nổi tiếng; 7 căn ph&ograve;ng trưng b&agrave;y lưu giữ c&aacute;c lo&agrave;i động vật qu&yacute; hiếm., với 378 mẫu th&uacute; của 58 lo&agrave;i, 242 mẫu chim của 94 lo&agrave;i, v&agrave; 42 mẫu lưỡng th&ecirc; b&ograve; s&aacute;t của 32 lo&agrave;i ...c&ugrave;ng với c&aacute;c lo&agrave;i c&ocirc;n tr&ugrave;ng được trưng b&agrave;y theo tr&igrave;nh tự tiến ho&aacute; từ thấp đến cao.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Đo&agrave;n tiếp tục đi v&agrave;o x&atilde; L&aacute;t, bu&ocirc;n của người d&acirc;n tộc Lạt nằm dưới ch&acirc;n n&uacute;i Langbiang, tr&ecirc;n đường đi Qu&yacute; kh&aacute;ch ngắm cảnh ngoại &ocirc; Đ&agrave; Lạt với những nh&agrave; vườn trồng đủ loại hoa m&agrave;u. Qu&yacute; kh&aacute;ch leo n&uacute;i, chinh phục đỉnh Langbiang; từ đỉnh n&uacute;i chi&ecirc;m ngưỡng to&agrave;n cảnh th&agrave;nh phố Đ&agrave; Lạt thơ mộng, huyền ảo trong sương mờ.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi tối, Qu&yacute; kh&aacute;ch tự do hoặc tham dự đ&ecirc;m lửa trại, uống rượu cần, văn nghệ cồng chi&ecirc;ng, giao lưu văn h&oacute;a với người T&acirc;y Nguy&ecirc;n (chi ph&iacute; tự t&uacute;c), nghỉ đ&ecirc;m tại Đ&agrave; Lạt.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p><strong>NG&Agrave;Y 3 : Đ&Agrave; LẠT - C&Aacute;C THẮNG CẢNH</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, Xe đ&oacute;n v&agrave; đưa đo&agrave;n đến viếng nh&agrave; thờ Domain-de Marie, một c&ocirc;ng tr&igrave;nh kiến tr&uacute;c đặc sắc với kh&ocirc;ng gian h&agrave;i h&ograve;a ấm c&uacute;ng c&ugrave;ng nhiều lo&agrave;i hoa đặc trưng của v&ugrave;ng đất T&acirc;y nguy&ecirc;n.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Sau đ&oacute; Qu&yacute; kh&aacute;ch đến tham quan Biệt viện Bảo Đại - nơi lưu lại những dấu ấn ho&agrave;ng tộc của gia đ&igrave;nh vua Bảo Đại, vị vua cuối c&ugrave;ng của Triều Nguyễn n&oacute;i ri&ecirc;ng v&agrave; của chế độ phong kiến Việt Nam n&oacute;i chung; tiếp tục đo&agrave;n đến viếng Thiền Viện Tr&uacute;c L&acirc;m, đi c&aacute;p treo qua đồi R&ocirc;bin, ngắm cảnh rừng th&ocirc;ng, hồ Tuyền L&acirc;m v&agrave; n&uacute;i Phượng Ho&agrave;ng từ tr&ecirc;n cao.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, Xe đưa Qu&yacute; kh&aacute;ch đến tham quan Ga Đ&agrave; Lạt - nơi sở hữu nhiều kỉ lục như \"nh&agrave; ga cao nhất\", \"nh&agrave; ga cổ nhất\", \"nơi c&oacute; đầu t&agrave;u chạy bằng hơi nước duy nhất\", \"nh&agrave; ga độc đ&aacute;o nhất\" v&agrave; \"nh&agrave; ga đẹp nhất\" Việt Nam... tiếp tục xe đưa Qu&yacute; kh&aacute;ch đến với Trại M&aacute;t (hoặc Qu&yacute; kh&aacute;ch c&oacute; thể đi bằng xe lửa - chi ph&iacute; tự t&uacute;c) kh&aacute;m ph&aacute; thị trấn ngoại &ocirc; của phố n&uacute;i v&agrave; tham quan Ch&ugrave;a Linh Phước - hay ch&ugrave;a Ve Chai - một c&ocirc;ng tr&igrave;nh kiến tr&uacute;c Phật Gi&aacute;o đặc sắc được trang tr&iacute; chủ yếu bằng c&aacute;c loại gốm sứ. Qu&yacute; kh&aacute;ch gh&eacute; chợ Đ&agrave; Lạt mua đặc sản, hoặc tự do đi xe ngựa cổ bốn b&aacute;nh dạo quanh hồ Xu&acirc;n Hương</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi tối, chương tr&igrave;nh ri&ecirc;ng của Qu&yacute; kh&aacute;ch, nghỉ đ&ecirc;m tại Đ&agrave; Lạt.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p><strong>NG&Agrave;Y 4 : Đ&Agrave; LẠT - S&Agrave;I G&Ograve;N (300 Km)</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, Qu&yacute; kh&aacute;ch trả ph&ograve;ng, Sau đ&oacute;, xe đưa đo&agrave;n về Th&agrave;nh Phố Bảo Lộc, Qu&yacute; kh&aacute;ch thưởng thức đặc sản tr&agrave;, c&agrave; ph&ecirc; nổi tiếng nơi đ&acirc;y.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Đo&agrave;n khởi h&agrave;nh về TP.Hồ Ch&iacute; Minh theo cung đường Ng&atilde; ba C&aacute;t L&aacute;i - hầm Thủ Thi&ecirc;m, hầm vượt s&ocirc;ng d&agrave;i nhất Đ&ocirc;ng Nam &Aacute;.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, Đo&agrave;n về đến S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Ăn s&aacute;ng, trưa)</p>'),(46,4,73,0,5,'<p><span>&nbsp; &nbsp;</span><em><strong>&nbsp;Du ngoạn phong cảnh cao nguy&ecirc;n.<br />&nbsp;&nbsp;&nbsp; Kh&aacute;m ph&aacute; L&agrave;ng hoa Th&aacute;i Phi&ecirc;n, Thiền viện Tr&uacute;c L&acirc;m, Hồ Than Thở c&ugrave;ng nhiều danh thắng kh&aacute;c<br />&nbsp;&nbsp;&nbsp; Giao lưu văn h&oacute;a T&acirc;y Nguy&ecirc;n.<br />&nbsp;&nbsp;&nbsp; Thưởng thức c&aacute;c m&oacute;n ngon Chợ đ&ecirc;m &acirc;m phủ: Sữa đậu n&agrave;nh, khoai lang, bắp nướng mỡ h&agrave;nh.<br />&nbsp;&nbsp;&nbsp; Đặc sản Đ&agrave; Lạt: C&aacute;c loại rau củ, hoa quả, atis&ocirc;, mứt tr&aacute;i c&acirc;y, rượu vang.<br />&nbsp;&nbsp;&nbsp; Qu&agrave; lưu niệm: Tranh th&ecirc;u, &aacute;o, n&oacute;n, khăn len, hoa bất tử, hoa kh&ocirc;...</strong></em></p>'),(47,4,137,0,5,NULL),(48,4,138,0,5,NULL),(49,4,83,0,5,NULL),(50,4,106,0,5,NULL),(55,4,72,0,6,'<p><strong>NG&Agrave;Y 1 :&nbsp;&nbsp; S&Agrave;I G&Ograve;N - PHAN THIẾT (198 Km)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, xe đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, L&ecirc; Duẩn, Đồng Khởi, Bạch Đằng, Nguyễn Hữu Cảnh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n.. Đến Phan Thiết (tỉnh B&igrave;nh Thuận), đo&agrave;n đi qua khu phố thị trung t&acirc;m Th&agrave;nh Phố, ngắm cảnh d&ograve;ng s&ocirc;ng C&agrave; Ty hiền h&ograve;a. Sau đ&oacute;, xe đưa đo&agrave;n đến nh&agrave; h&agrave;ng d&ugrave;ng cơm trưa.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, xe đưa đo&agrave;n đi H&ograve;n Rơm, tr&ecirc;n đường, đo&agrave;n đi ngang qua v&agrave; ngắm những danh lam thắng t&iacute;ch của Phan Thiết như : di t&iacute;ch Lầu &Ocirc;ng Ho&agrave;ng, Th&aacute;p Ch&agrave;m P&ocirc;sanư, B&atilde;i đ&aacute; &Ocirc;ng Địa, Rặng dừa H&agrave;m Tiến... v&agrave; ngắm cảnh ghe thuyền của ngư d&acirc;n về cập bến ở Bến thuyền Mũi N&eacute;. Đo&agrave;n dừng lại tham quan Bảo t&agrave;ng Ngọc Trai Long Beach Pearl Mũi N&eacute;, l&agrave; một trong hai trung t&acirc;m Ngọc Trai lớn nhất khu vực miền trung do tập đo&agrave;n Long Beach Pearl đầu tư. Đến đ&acirc;y Qu&yacute; kh&aacute;ch được nghe giới thiệu về qui tr&igrave;nh nu&ocirc;i cấy - khai th&aacute;c - chế t&aacute;c ngọc trai, được tham quan khu trưng b&agrave;y với hơn 3.000 mẫu ngọc trai thiết kế tinh tế - đẹp mắt v&agrave; sang trọng.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Đến H&ograve;n Rơm, Qu&yacute; kh&aacute;ch tắm biển v&agrave; thưởng thức hải sản tươi ngon gi&aacute; b&igrave;nh d&acirc;n. Sau khi thưởng thức hương vị ngọt ng&agrave;o của tr&aacute;i dừa 3 nh&aacute;t, Qu&yacute; kh&aacute;ch tiếp tục chinh phục Đồi C&aacute;t Bay, suối Hồng, chi&ecirc;m ngưỡng cảnh ho&agrave;ng h&ocirc;n tr&ecirc;n biển Phan Thiết.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi tối, Qu&yacute; kh&aacute;ch đi dạo phố biển, nghỉ đ&ecirc;m tại Phan Thiết.</p>\r\n<p>(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p><strong>NG&Agrave;Y 2 : PHAN THIẾT - S&Agrave;I G&Ograve;N (198 Km)</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, Qu&yacute; kh&aacute;ch tắm biển tại b&atilde;i biển Đồi Dương (nếu nghỉ tại trung t&acirc;m Th&agrave;nh Phố), hoặc tắm tại c&aacute;c resort (nếu nghỉ tại c&aacute;c resort ven biển).</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi trưa, trả ph&ograve;ng, đo&agrave;n đi chợ Phan Thiết, Qu&yacute; kh&aacute;ch mua đặc sản Phan Thiết. Sau đ&oacute; gh&eacute; tham quan khu du lịch N&uacute;i T&agrave; C&uacute;. Đo&agrave;n khởi h&agrave;nh về TP.Hồ Ch&iacute; Minh theo cung đường Ng&atilde; ba C&aacute;t L&aacute;i - hầm Thủ Thi&ecirc;m, hầm vượt s&ocirc;ng d&agrave;i nhất Đ&ocirc;ng Nam &Aacute;.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, về đến S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; Kh&aacute;ch.</p>'),(56,4,73,0,6,'<p><em><strong>Du ngoạn phong cảnh miền biển.<br />&nbsp;&nbsp;&nbsp; Tắm biển, trượt đồi c&aacute;t bay.<br />&nbsp;&nbsp;&nbsp; Thưởng thức m&oacute;n ngon: Ghẹ, s&ograve; điệp, mực nướng, b&aacute;nh căn, b&aacute;nh x&egrave;o, b&aacute;nh canh chả c&aacute;.<br />&nbsp;&nbsp;&nbsp; Đặc sản B&igrave;nh Thuận: Nước mắm c&aacute; cơm, mực một nắng, hải sản kh&ocirc;, t&ocirc;m kh&ocirc;, c&aacute; tẩm gia vị, thanh long.</strong></em></p>'),(57,4,137,0,6,NULL),(58,4,138,0,6,NULL),(59,4,83,0,6,NULL),(60,4,106,0,6,NULL),(61,4,72,0,7,'<p><strong>NG&Agrave;Y 1 : &nbsp;S&Agrave;I G&Ograve;N - PHAN RANG (334 Km)</strong></p>\r\n<p>&nbsp; &nbsp; Buổi s&aacute;ng, khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, xe đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, L&ecirc; Duẩn, Đồng Khởi, Bạch Đằng, Nguyễn Hữu Cảnh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n... Đo&agrave;n đi qua Phan Thiết, tham quan một tho&aacute;ng trung t&acirc;m th&agrave;nh phố với những resort, khu nghỉ dưỡng, khu giải tr&iacute; cao cấp ven biển. Qu&yacute; kh&aacute;ch dừng ch&acirc;n đ&oacute;n gi&oacute; biển, chụp ảnh lưu niệm ở b&atilde;i biển C&agrave; N&aacute;. Đến thị x&atilde; Phan Rang - Th&aacute;p Ch&agrave;m (tỉnh Ninh Thuận).</p>\r\n<p>&nbsp; &nbsp; Buổi chiều, Qu&yacute; Kh&aacute;ch đến kh&aacute;ch sạn nhận ph&ograve;ng v&agrave; tắm biển tại b&atilde;i tắm gần kh&aacute;chsạn.Buổi tối, Qu&yacute; kh&aacute;ch dạo phố biển về đ&ecirc;m, Nghỉ đ&ecirc;m tại Phan Rang - Th&aacute;p Ch&agrave;m.</p>\r\n<p>(Ăn s&aacute;ng, trưa, chiều)</p>\r\n<p><strong>NG&Agrave;Y 2 : PHAN RANG - VĨNH HY (42 km)</strong></p>\r\n<p>&nbsp; &nbsp; Buổi s&aacute;ng, xe đưa đo&agrave;n đi qua ruộng muối Ninh Hải, khu bảo tồn thi&ecirc;n nhi&ecirc;n n&uacute;i Ch&uacute;a để đến vịnhVĩnh Hy, Qu&yacute; kh&aacute;ch xuống t&agrave;u ra thưởng ngoạn phong cảnh vịnh, rất thơ mộng h&ugrave;ng vĩ với mũi C&aacute;Heo, mũi Yến, mũi Cọc, mũi Ốc Rạng, hang Yến, đầm Đăng, b&atilde;i tắm B&agrave; Đi&ecirc;n. Qua t&agrave;u đ&aacute;y k&iacute;nh Qu&yacute;kh&aacute;ch ngắm san h&ocirc;, c&aacute; biển nhiều m&agrave;u sắc, kh&aacute;m ph&aacute; cuộc sống cư d&acirc;n miền biển, thử l&agrave;m ngư phủ c&acirc;uc&aacute; thu, c&aacute; ngừ tại b&atilde;i T&acirc;y Sa v&agrave; h&ograve;n B&ograve; B&ograve;, thưởng thức hải sản tươi ngon được đưa trực tiếp từ biển l&ecirc;n.</p>\r\n<p>&nbsp; &nbsp; Buổi chiều, đo&agrave;n đi tham quan l&agrave;ng dệt thổ cẩm Mỹ Nghiệp, l&agrave;ng gốm Chăm B&agrave;u Tr&uacute;c, th&aacute;p ch&agrave;mPoklonggarai, chinh phục đồi c&aacute;t Nam Cương.</p>\r\n<p>&nbsp; &nbsp; Buổi tối, Qu&yacute; Kh&aacute;ch tự do.</p>\r\n<p>(Ăn s&aacute;ng, trưa, chiều)&nbsp;</p>\r\n<p><strong>NG&Agrave;Y 3 : NINH CHỮ - S&Agrave;I G&Ograve;N ( 334 Km )</strong></p>\r\n<p>&nbsp; &nbsp;Buổi s&aacute;ng, Qu&yacute; Kh&aacute;ch tự do tắm biển, sau đ&oacute; trả ph&ograve;ng v&agrave; đi tham quan vườn nho, thưởng thức đặc sản Phan Rang.Đo&agrave;n khởi h&agrave;nh về TP.Hồ Ch&iacute; Minh theo cung đường Ng&atilde; ba C&aacute;t L&aacute;i - hầm Thủ Thi&ecirc;m, hầm vượt s&ocirc;ng d&agrave;i nhất Đ&ocirc;ng Nam &Aacute;.</p>\r\n<p>&nbsp; &nbsp; Buổi chiều, về đến S&agrave;i G&ograve;n chia tay hẹn ng&agrave;y t&aacute;i ngộ.</p>'),(62,4,73,0,7,'<p><strong>Tắm biển. Kh&aacute;m ph&aacute; vịnh Vĩnh Hy qua t&agrave;u đ&aacute;y k&iacute;nh.</strong></p>\r\n<p><strong>Thưởng thức c&aacute;c m&oacute;n ngon: B&aacute;nh căn, b&aacute;nh x&egrave;o, b&aacute;nh b&egrave;o.</strong></p>\r\n<p><strong>Q&ugrave;a lưu niệm: Vải thổ cẩm, gốm Chăm B&agrave;u Tr&uacute;c.</strong></p>\r\n<p><strong>Đặc sản Ninh Thuận: Con D&ocirc;ng, mực một nắng, hải sản kh&ocirc;, nước mắm, tỏi, nho...&nbsp;</strong></p>'),(63,4,137,0,7,NULL),(64,4,138,0,7,NULL),(65,4,83,0,7,NULL),(66,4,106,0,7,NULL),(67,4,72,0,8,'The Mekong Delta is the southernmost region of Vietnam. It is often referred to as the rice bowl of Vietnam as it produces three harvests per year. The fertile Mekong Delta is also famous for its tropical fruits and flowers. The Delta area marks the end of a 4,500km journey made by the Mekong River after having traveled through six countries. Traditional transportation in the Delta is by boat along a vast network of canals and channels. Boating along these canals and visiting the floating markets always proves to be a fascinating and rewarding experience for all visitors.\r\n\r\nStart early in the morning for our drive to Cai Be, where we board our private boat for a cruise through the busy Cai Be floating market. Visit a local house boat & chat with family member to know their daily life.\r\nWe then visit some local cottage industries such as the coconut candy workshop, learn how to make pop-rice, or witnessing the process of making rice paper.\r\nContinue with our cruise through the maze of canals the criss-cross the An Binh Island, we land at an ancient house. Here we taste the fresh tropical fruits of the Delta and have lunch with local cuisines.\r\nAfter lunch, take a short row on local sampan, then get back on motor boat to the Nursery Garden of Mr Tam Ho. Continue cruising to visit the Brick & pottery kiln then to Vinh Long town.\r\nDrive back from Vinh Long town to Ho Chi Minh. End of service.\r\n'),(68,4,73,0,8,'Depart from: Ho Chi Minh\r\nReturn to: Ho Chi MInh\r\nActivities: Walking, boat trip, rowing local sampan\r\nHighlights: Boat trip in Mekong river, Cai Be floating market, Rowing on local sampan, Ancient House in Mekong Delta, Nursery garden\r\n\r\n\r\n\r\n'),(69,4,137,0,8,'Start early in the morning for our drive to Cai Be, where we board our private boat for a cruise through the busy Cai Be floating market. Visit a local house boat & chat with family member to know their daily life.\r\nWe then visit some local cottage industries such as the coconut candy workshop, learn how to make pop-rice, or witnessing the process of making rice paper.\r\nContinue with our cruise through the maze of canals the criss-cross the An Binh Island, we land at an ancient house. Here we taste the fresh tropical fruits of the Delta and have lunch with local cuisines.\r\nAfter lunch, take a short row on local sampan, then get back on motor boat to the Nursery Garden of Mr Tam Ho. Continue cruising to visit the Brick & pottery kiln then to Vinh Long town.\r\nDrive back from Vinh Long town to Ho Chi Minh. End of service.\r\n'),(70,4,138,0,8,'Inclusions \r\nAir-conditioned transportation by private vehicle \r\nBoat tour in Mekong Delta\r\nEnglish speaking guide\r\nEntrance fees\r\nLunch \r\nExclusions \r\nPersonal expenses \r\n'),(71,4,83,0,8,NULL),(72,4,106,0,8,NULL);
