INSERT INTO `catalogsearch_fulltext` VALUES (3,1,1,'CT|2 Days|Bus|Bus|None|Can Tho Tour|Saturday|NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - CẦN THƠ (170km) &nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa Du Kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng... &nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, đo&agrave;n đi qua G&ograve; Đen, Bến Lức, T&acirc;n An (tỉnh Long An), qu&ecirc; hương c&oacute; hai d&ograve;ng s&ocirc;ng V&agrave;m Cỏ Đ&ocirc;ng, V&agrave;m Cỏ T&acirc;y chảy qua, c&oacute; đặc sản rượu đế G&ograve; Đen, gạo n&agrave;ng Thơm Chợ Đ&agrave;o, thơm Bến Lức. &nbsp;&nbsp; &nbsp;Tới th&agrave;nh phố Mỹ Tho (tỉnh Tiền Giang), du kh&aacute;ch tham quan v&ugrave;ng đất trứ danh của thời Nam Kỳ lục Tỉnh, c&ograve;n c&oacute; t&ecirc;n l&agrave; Mỹ Tho Đại Phố. Xuống đ&ograve; qua s&ocirc;ng Tiền, du kh&aacute;ch tham quan l&agrave;ng nghề truyền thống l&ograve; kẹo dừa, cơ sở nu&ocirc;i ong lấy mật...; đi xe ngựa tr&ecirc;n con lộ nhỏ uốn kh&uacute;c quanh co, ngắm những l&agrave;ng qu&ecirc; rợp b&oacute;ng dừa ở xứ Bến Tre; ngồi xuồng ch&egrave;o kh&aacute;m ph&aacute; cuộc sống s&ocirc;ng nước miền T&acirc;y. Xe đ&oacute;n v&agrave; tiếp tục đưa du kh&aacute;ch đi qua cầu Rạch Miễu - một c&ocirc;ng tr&igrave;nh mới ho&agrave;n th&agrave;nh của tỉnh Bến Tre. &nbsp;&nbsp; &nbsp;Buổi chiều, qua cầu Cần Thơ, đo&agrave;n tham quan nh&agrave; cổ B&igrave;nh Thủy, được x&acirc;y dựng từ năm 1870, kiến tr&uacute;c ti&ecirc;u biểu của Nam Bộ, nh&agrave; c&oacute; năm gian hai ch&aacute;i, sườn nh&agrave; bằng gỗ được chạm khắc tinh tế, đi&ecirc;u luyện, c&oacute; vườn lan v&agrave; c&acirc;y xương rồng 40 tuổi, c&ograve;n gọi l&agrave; \"Kim Lăng Trụ\", cao 8 thước, được x&aacute;c lập kỷ lục cao nhất Việt Nam. &nbsp;&nbsp; &nbsp;Buổi tối, xe đưa đo&agrave;n đi bến Ninh Kiều, nằm ở ng&atilde; ba s&ocirc;ng Hậu v&agrave; từng được mệnh danh l&agrave; đệ nhất danh thắng xứ T&acirc;y Đ&ocirc;, du kh&aacute;ch dạo chơi, thưởng thức c&agrave; ph&ecirc; ở c&aacute;c qu&aacute;n Thủy Tạ ven s&ocirc;ng. D&ugrave;ng bữa chiều với c&aacute;c m&oacute;n ăn Nam Bộ tr&ecirc;n du thuyền Cần Thơ v&agrave; lắng nghe những giai điệu ngọt ng&agrave;o của miền s&ocirc;ng nước. Sau đ&oacute;, Qu&yacute; kh&aacute;ch c&oacute; thể tự do đi dao chợ đ&ecirc;m T&acirc;y Đ&ocirc;, hoặc về khu đ&ocirc; thị mới C&aacute;i Khế, để kh&aacute;m ph&aacute; n&eacute;t nhộn nhịp, sầm uất của Cần Thơ về đ&ecirc;m. &nbsp; &nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều) &nbsp; NG&Agrave;Y 2: CẦN THƠ - S&Agrave;I G&Ograve;N (170km)&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, đo&agrave;n xuống đ&ograve; đi chợ nổi C&aacute;i Răng, theo c&aacute;c m&oacute;n h&agrave;ng treo tr&ecirc;n c&acirc;y ch&egrave;o bẻo ở đầu ghe, du kh&aacute;ch c&ugrave;ng mua b&aacute;n với kh&aacute;ch thương hồ miền t&acirc;y, t&igrave;m hiểu n&eacute;t văn h&oacute;a mua b&aacute;n tr&ecirc;n s&ocirc;ng rất đặc trưng của người Nam Bộ. &nbsp;&nbsp;&nbsp; Tiếp tục xe đưa Qu&yacute; kh&aacute;ch đến vườn du lịch Mỹ Kh&aacute;nh, men theo những con đường nhỏ, du kh&aacute;ch dạo chơi trong một kh&ocirc;ng gian xanh của những vườn mận, xo&agrave;i, ch&ocirc;m ch&ocirc;m, m&iacute;t, sầu ri&ecirc;ng... Tham gia l&agrave;m b&aacute;nh tr&aacute;ng, nấu rượu đế, thưởng thức những m&oacute;n ngon rất d&acirc;n d&atilde; như c&aacute; l&oacute;c nướng ống tre, chuột quay lu, lẩu đồng qu&ecirc;... Sau đ&oacute; đo&agrave;n di chuyển qua tham quan Thiền viện Tr&uacute;c L&acirc;m Phương Nam - Thiền viện lớn v&agrave; đẹp nhất miền T&acirc;y Nam Bộ. &nbsp; &nbsp;&nbsp;&nbsp; Buổi chiều, xe đưa đo&agrave;n đi qua cầu Cần Thơ (Th&agrave;nh phố Cần Thơ), cầu treo Mỹ Thuận (tỉnh Vĩnh Long) theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n. &nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch. &nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)|GI&Aacute; V&Eacute; BAO GỒM&nbsp;: Xe đời mới c&oacute; m&aacute;y lạnh, v&eacute; t&agrave;u đ&ograve; du lịch đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh tour. &nbsp; Kh&aacute;ch sạn: Ph&ograve;ng 2 - 3 kh&aacute;ch, c&oacute; m&aacute;y lạnh, tivi, tủ lạnh, điện thoại, nước n&oacute;ng, vệ sinh ri&ecirc;ng. &nbsp; Kh&aacute;ch sạn đạt chuẩn:&nbsp;&nbsp;HOLIDAY, HẬU GIANG, T&Acirc;Y NAM, NINH KIỀU, PHƯƠNG Đ&Ocirc;NG,&nbsp;T&Acirc;Y Đ&Ocirc;. &nbsp; Kh&aacute;ch sạn 4 sao&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;NINH KIỀU 2, GOLF 4 CẦN THƠ, VẠN PH&Aacute;T 1. &nbsp; (Hoặc c&aacute;c kh&aacute;ch sạn tương đương) &nbsp; Ăn uống gồm 3 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa v&agrave; chiều l&agrave; cơm phần 4 m&oacute;n, được đổi m&oacute;n thường xuy&ecirc;n theo ẩm thực địa phương. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ: 310.000 VNĐ &nbsp; Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến. &nbsp; V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh. &nbsp; Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y). &nbsp; Qu&agrave; tặng, xổ số vui c&oacute; thưởng. &nbsp; Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp. &nbsp; GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM&nbsp;: &nbsp; C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n. &nbsp; GI&Aacute; V&Eacute; TRẺ EM: Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ&nbsp;được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;. &nbsp; (Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).|80|1'),(4,1,2,'CT|2 Days|Bus|Bus|None|Can Tho Tour|Saturday|NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - CẦN THƠ (170km) &nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa Du Kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng... &nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, đo&agrave;n đi qua G&ograve; Đen, Bến Lức, T&acirc;n An (tỉnh Long An), qu&ecirc; hương c&oacute; hai d&ograve;ng s&ocirc;ng V&agrave;m Cỏ Đ&ocirc;ng, V&agrave;m Cỏ T&acirc;y chảy qua, c&oacute; đặc sản rượu đế G&ograve; Đen, gạo n&agrave;ng Thơm Chợ Đ&agrave;o, thơm Bến Lức. &nbsp;&nbsp; &nbsp;Tới th&agrave;nh phố Mỹ Tho (tỉnh Tiền Giang), du kh&aacute;ch tham quan v&ugrave;ng đất trứ danh của thời Nam Kỳ lục Tỉnh, c&ograve;n c&oacute; t&ecirc;n l&agrave; Mỹ Tho Đại Phố. Xuống đ&ograve; qua s&ocirc;ng Tiền, du kh&aacute;ch tham quan l&agrave;ng nghề truyền thống l&ograve; kẹo dừa, cơ sở nu&ocirc;i ong lấy mật...; đi xe ngựa tr&ecirc;n con lộ nhỏ uốn kh&uacute;c quanh co, ngắm những l&agrave;ng qu&ecirc; rợp b&oacute;ng dừa ở xứ Bến Tre; ngồi xuồng ch&egrave;o kh&aacute;m ph&aacute; cuộc sống s&ocirc;ng nước miền T&acirc;y. Xe đ&oacute;n v&agrave; 