thưởng. &nbsp; Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp. &nbsp; GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM&nbsp;: &nbsp; C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n. &nbsp; GI&Aacute; V&Eacute; TRẺ EM: Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ&nbsp;được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;. &nbsp; (Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).|80|1'),(20,2,2,'DT-GG|2 Days|Bus|Bus|Taxable Goods|Đồng Tháp - Gáo Giồng|Saturday|Sunday|GI&Aacute; V&Eacute; BAO GỒM :&nbsp;Xe đời mới c&oacute; m&aacute;y lạnh, v&eacute; t&agrave;u đ&ograve; du lịch, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh trong tour.&nbsp;Ăn uống gồm 2 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa l&agrave; cơm phần 4 m&oacute;n.&nbsp;&nbsp;Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.&nbsp;V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.&nbsp;Khăn lạnh, nước suối tr&ecirc;n đường (1 khăn, 1 chai/ ng&agrave;y).&nbsp;Qu&agrave; tặng, xổ số vui c&oacute; thưởng.&nbsp;Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000vnđ/trường hợp.GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.GI&Aacute; V&Eacute; TRẺ EM:&nbsp;&nbsp; &nbsp;Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.Trẻ em từ 06 đến 11 tuổi mua 2/3 v&eacute; tour: 500.000 VNĐTrẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 2/3 v&eacute;. (Ti&ecirc;u chuẩn 2/3 v&eacute;: được 01 suất ăn + 01 ghế ngồi)|Buổi s&aacute;ng: S&Agrave;I G&Ograve;N CAO L&Atilde;NH&nbsp;(162km) Xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, Chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng. Theo quốc lộ 1A, du kh&aacute;ch dừng ăn s&aacute;ng ở Mỹ Tho. Tới th&agrave;nh phố Cao L&atilde;nh, đo&agrave;n đi đ&ograve; v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng, Du kh&aacute;ch ngồi xuồng ba l&aacute;&nbsp; qua những lung sen thơm ng&aacute;t, v&ocirc; rừng tr&agrave;m nơi c&aacute;c lo&agrave;i chim c&ograve;, tr&iacute;ch, diệt, cồng cộc, le le, giang sen, cu xanh... tụ hội về kiếm ăn v&agrave; l&agrave;m tổ nằm trong khu thi&ecirc;n nhi&ecirc;n rộng 1.640ha thuộc Đồng Th&aacute;p Mười. Qu&yacute; kh&aacute;ch d&ugrave;ng bữa trưa giữa một khung cảnh đồng qu&ecirc; y&ecirc;n tĩnh, c&oacute; những&nbsp; c&aacute;nh c&ograve;, tr&iacute;ch bay lượn xa xa, với c&aacute;c m&oacute;n ăn đặc sản ốc l&aacute;t hấp h&egrave;m, c&aacute; l&oacute;c nướng l&aacute; sen, g&agrave; x&eacute; phai, rau đồng luộc ăn với c&aacute; tr&ecirc; chi&ecirc;n mắm&nbsp; gừng... Buổi chiều: CAO L&Atilde;NH SAĐ&Eacute;C S&Agrave;I G&Ograve;N&nbsp;(177km) Sau bữa ăn trưa ở khu du lịch G&aacute;o Giồng, đo&agrave;n đi Sa Đ&eacute;c viếng ch&ugrave;a Kiến An Cung, tham quan nh&agrave; cổ Huỳnh Thủy L&ecirc;, của một b&aacute; hộ ở Sa Đ&eacute;c xưa, nghe c&acirc;u chuyện t&