;.GI&Aacute; V&Eacute; TRẺ EM:&nbsp;&nbsp;&nbsp; &nbsp;-&nbsp;&nbsp;&nbsp; Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.-&nbsp;&nbsp;&nbsp; Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.-&nbsp;&nbsp;&nbsp;&nbsp; Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;.(Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).|NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - SA Đ&Eacute;C - CAO L&Atilde;NH - TR&Agrave;M CHIM (220km) &nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh, nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng. &nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, du kh&aacute;ch chinh phục cầu treo Mỹ Thuận, cảm nhận vẻ đẹp dịu d&agrave;ng n&ecirc;n thơ của d&ograve;ng s&ocirc;ng Tiền. Tiếp tục theo quốc lộ 80, đo&agrave;n ngang qua những vườn c&acirc;y ăn tr&aacute;i xum xu&ecirc; như vươn hẳn ra ven đường vẫy gọi du kh&aacute;ch phương xa. &nbsp;&nbsp; &nbsp;Đến thị x&atilde; Sa Đ&eacute;c, xứ sở phố thị miền s&ocirc;ng nước, &ecirc;m đềm nhưng kh&ocirc;ng k&eacute;m vui tươi. Du kh&aacute;ch sẽ tham quan ch&ugrave;a cổ Kiến An Cung của người Hoa, chỉ cần bước qua hai con k&igrave; l&acirc;n bằng đ&aacute; xanh v&agrave;o cửa, du kh&aacute;ch sẽ cảm nhận được sự thanh tao v&agrave; lộng lẫy của nơi n&agrave;y, mỗi chi tiết kiến tr&uacute;c đều thể hiện độ tinh xảo của nghệ nh&acirc;n. Những ho&agrave;nh phi c&acirc;u đối, v&agrave; h&igrave;nh tượng được khắc nổi đều chứa đựng những ẩn &yacute; th&acirc;m s&acirc;u tượng trưng cho niềm tin cuộc sống. Du kh&aacute;ch như xua tan hết mọi phiền n&atilde;o của đời thường khi chi&ecirc;m b&aacute;i trước Quan Th&aacute;nh Đế Qu&acirc;n tuy uy nghi&ecirc;m nhưng rất gần gũi v&agrave; thi&ecirc;ng li&ecirc;ng. &nbsp;&nbsp; &nbsp;Rời ch&ugrave;a, du kh&aacute;ch sẽ đến với nh&agrave; cổ Huỳnh Thủy L&ecirc;, t&igrave;m hiểu kiến tr&uacute;c đặc sắc Đ&ocirc;ng - T&acirc;y h&ograve;a quyện, nghe thuyết minh về mối t&igrave;nh bất hủ giữa chủ nh&acirc;n ng&ocirc;i nh&agrave;, &ocirc;ng Huỳnh Thủy L&ecirc; (người Việt gốc Hoa) v&agrave; b&agrave; Marguerite Duras (người Ph&aacute;p). Chuyện t&igrave;nh l&atilde;ng mạn v&agrave; đẫm lệ n&agrave;y đ&atilde; được b&agrave; Marguerite kể lại trong cuốn tiểu thuyết Người T&igrave;nh, đ&atilde; dịch ra 43 thứ tiếng, sau đ&oacute; được chuyển thể th&agrave;nh bộ phim c&ugrave;ng t&ecirc;n Người T&igrave;nh, nổi tiếng khắp thế giới. &nbsp;&nbsp; &nbsp;Du kh&aacute;ch sẽ tiếp tục kh&aacute;m ph&aacute; l&agrave;ng hoa T&acirc;n Quy Đ&ocirc;ng, vườn hoa lớn nhất v&ugrave;ng T&acirc;y Nam Bộ. Du kh&aacute;ch sẽ đi bộ ngắm cảnh v&agrave; chi&ecirc;m ngưỡng&nbsp; h&agrave;ng trăm lo&agrave;i \" kỳ hoa dị thảo\" đua nhau khoe sắc khắp v&ugrave;ng cũng như h&ograve;a m&igrave;nh v&agrave;o khung cảnh mua b&aacute;n tr&ecirc;n bến dưới thuyền của L&agrave;ng hoa. &nbsp;&nbsp; &nbsp;Tiếp tục h&agrave;nh tr&igrave;nh xe đưa đo&agrave;n qua ph&agrave; Cao L&atilde;nh v&agrave;o th&agrave;nh phố Cao L&atilde;nh. Sau buổi cơm trưa, đo&agrave;n tham quan Vườn quốc gia Tr&agrave;m Chim Tam N&ocirc;ng, thuộc huyện Tam N&ocirc;ng, tỉnh Đồng Th&aacute;p. &nbsp;&nbsp; &nbsp;Đo&agrave;n sẽ c&oacute; dịp trải nghiệm cảm gi&aacute;c ch&ograve;ng ch&agrave;nh khi đi vỏ l&atilde;i lướt tr&ecirc;n s&oacute;ng nước xuy&ecirc;n những c&aacute;nh đồng l&uacute;a ma, xuy&ecirc;n rừng tr&agrave;m, xuy&ecirc;n những c&aacute;nh đồng Sen... Qu&yacute; kh&aacute;ch như h&ograve;a m&igrave;nh v&agrave;o thi&ecirc;n nhi&ecirc;n hoang d&atilde;, thỏa sức ngắm nh&igrave;n những sinh cảnh đặc biệt của Tr&agrave;m Chim theo m&ugrave;a như: -&nbsp;&nbsp; &nbsp;Th&aacute;ng 9 - 10 l&agrave; m&ugrave;a chim đẻ trứng, du kh&aacute;ch sẽ ngắm những tổ chim lơ lững tr&ecirc;n những c&agrave;nh tr&agrave;m, chim mẹ mớm mồi, chim con tập bay... -&nbsp;&nbsp; &nbsp;Th&aacute;ng 12 - 4 l&agrave; m&ugrave;a Sếu về: nếu may mắn Qu&yacute; kh&aacute;ch c&oacute; thể tận mắt thấy được Sếu Đầu Đỏ, lo&agrave;i chim thanh cao v&agrave; qu&yacute; hiếm nằm trong s&aacute;ch đỏ Việt Nam v&agrave; thế giới. -&nbsp;&nbsp; &nbsp;V&agrave; bất kỳ l&uacute;c n&agrave;o Qu&yacute; kh&aacute;ch cũng c&oacute; thể cảm nhận được m&ugrave;i của đồng qu&ecirc; với hoa tr&agrave;m, hoa s&uacute;ng, hoa sen; m&ugrave;i cỏ, m&ugrave;i năng, m&ugrave;i l&uacute;a ma... -&nbsp;&nbsp; &nbsp;Bất kỳ nơi n&agrave;o Qu&yacute; kh&aacute;ch cũng được h&ograve;a m&igrave;nh v&agrave;o m&ocirc;i trường sống hoang d&atilde; của h&agrave;ng chục lo&agrave;i c&aacute; đồng, h&agrave;ng trăm lo&agrave;i chim trời v&agrave; động vật hoang d&atilde; nơi đ&acirc;y... thỏa sức ngắm nh&igrave;n từng đ&agrave;n chim tr&iacute;ch đua nhau ra bờ k&ecirc;nh t&igrave;m mồi; từng đ&agrave;n Nhan Sen, Quốc lặn ngụp dưới nước để bắt c&aacute; v&agrave; nhiều nhiều cảnh quan sinh động kh&aacute;c của cuộc sống hoang d&atilde; nơi đ&acirc;y. &nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch d&ugrave;ng buổi chiều tại thị trấn Tr&agrave;m Chim với c&aacute;c m&oacute;n ăn d&acirc;n d&atilde; đặc trưng theo m&ugrave;a của v&ugrave;ng Đồng Th&aacute;p Mười như: lẩu ch&aacute;o lươn, c&aacute; tr&ecirc; nướng mắm gừng, canh chua c&aacute; l&oacute;c đồng, đi&ecirc;n điển x&agrave;o t&eacute;p... &nbsp;&nbsp; &nbsp;Đo&agrave;n về lại th&agrave;nh phố Cao L&atilde;nh nhận ph&ograve;ng nghỉ ngơi. Nghỉ đ&ecirc;m tại Cao L&atilde;nh. &nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều) &nbsp; NG&Agrave;Y 2: CAO L&Atilde;NH&nbsp; G&Aacute;O GIỒNG&nbsp; S&Agrave;I G&Ograve;N (196km)&nbsp; &nbsp;&nbsp;&nbsp; Buổi s&aacute;ng: sau khi d&ugrave;ng điểm t&acirc;m s&aacute;ng v&agrave; l&agrave;m thủ tục trả ph&ograve;ng, xe đưa đo&agrave;n khởi h&agrave;nh v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng thuộc huyện Cao L&atilde;nh, tỉnh Đồng Th&aacute;p. &nbsp;&nbsp;&nbsp; Xu&ocirc;i m&aacute;i ch&egrave;o tr&ecirc;n xuồng tam bản c&ugrave;ng c&aacute;c c&ocirc; g&aacute;i mặc &aacute;o b&agrave; ba xinh đẹp, du kh&aacute;ch tận hưởng khung cảnh chim trời c&aacute; nước m&ecirc;nh m&ocirc;ng, sen hồng phủ k&iacute;n mặt nước, rẽ từng cụm b&egrave;o c&aacute;m xanh ngắt len l&otilde;i tr&ecirc;n những con rạch nhỏ xuy&ecirc;n rừng tr&agrave;m v&agrave;o s&acirc;n chim, Qu&yacute; kh&aacute;ch sẽ tai nghe, mắt thấy h&agrave;ng trăm lo&agrave;i chim cư ngụ nơi đ&acirc;y. Du kh&aacute;ch sẽ l&ecirc;n đ&agrave;i quan s&aacute;t cao 18m, ngắm k&iacute;nh viễn vọng để cảm nhận một m&agrave;u xanh bất tận của rừng tr&agrave;m v&agrave; m&agrave;u trắng nhấp nh&ocirc; của h&agrave;ng ng&agrave;n con chim đủ loại đang sinh s&ocirc;i v&agrave; tr&uacute; ngụ nơi n&agrave;y. &nbsp;&nbsp;&nbsp; Thỏa sức với một chuyến kh&aacute;m ph&aacute; căng sức, Du kh&aacute;ch c&oacute; thể nghỉ ngơi tr&ecirc;n những chiếc v&otilde;ng mắc tr&ecirc;n nh&agrave; s&agrave;n đu đưa bởi những cơn gi&oacute; đồng nội, xa xa l&agrave; rừng tr&agrave;m, l&agrave; đồng năng v&agrave; những đ&agrave;n tr&iacute;ch đang t&igrave;m mồi; hoặc du kh&aacute;ch vừa nghỉ ngơi vừa c&acirc;u c&aacute;, c&aacute;i th&uacute; d&acirc;n d&atilde; th&ocirc;n qu&ecirc; nhưng kh&ocirc;ng k&eacute;m phần hấp dẫn, nhất l&agrave; buổi trưa Qu&yacute; kh&aacute;ch c&oacute; thể tận hưởng những th&agrave;nh quả do m&igrave;nh c&acirc;u được th&igrave; c&ograve;n g&igrave; th&uacute; vị cho bằng. Qu&yacute; kh&aacute;ch dung buổi trưa với những m&oacute;n ăn miệt đồng theo m&ugrave;a như; c&aacute; l&oacute;c nướng trui cặp l&aacute; sen non chấm nước mắm me, c&aacute; r&ocirc; kho tộ, c&aacute; linh nấu chua cơm mẻ với b&ocirc;ng s&uacute;ng... &nbsp;&nbsp;&nbsp; Buổi chiều: rời G&aacute;o Giồng, rời Đồng Th&aacute;p Mười - miệt qu&ecirc; d&acirc;n d&atilde; đậm chất Miền T&acirc;y, xe đưa đo&agrave;n theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n. &nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch. &nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)|80|1'),(22,3,2,'TC-GG|2 Days|Bus|Bus|Taxable Goods|Tràm Chim - Gáo Giồng|Saturday|GI&Aacute; V&Eacute; BAO GỒM :Xe đời mới c&oacute; m&aacute;y lạnh, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh tour.Kh&aacute;ch sạn ti&ecirc;u chuẩn 2 sao đến 3 sao: Ph&ograve;ng 2 kh&aacute;ch, c&oacute; m&aacute;y lạnh, tivi, tủ lạnh, điện thoại, nước n&oacute;ng, vệ&nbsp; sinh ri&ecirc;ng.Kh&aacute;ch sạn: S&Ocirc;NG TR&Agrave;, H&Ograve;A B&Igrave;NH, MỸ TR&Agrave;.(hoặc c&aacute;c kh&aacute;ch sạn tương đương)Ăn uống gồm 3 bữa trong ng&agrave;y. Điểm t&acirc;m s&aacute;ng. Ăn trưa v&agrave; chiều l&agrave; cơm phần 4 m&oacute;n, được đổim&oacute;n thường xuy&ecirc;n theo ẩm thực địa phương. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ: 340.000 VNĐ.Hướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).Qu&agrave; tặng, xổ số vui c&oacute; thưởng.Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.&nbsp;GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :C&aacute;c khoản phụ thu. Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; c&aacute; nh&acirc;n.Chi ph&iacute; c&acirc;u c&aacute;.GI&Aacute; V&Eacute; TRẺ EM:&nbsp;&nbsp;&nbsp; &nbsp;-&nbsp;&nbsp;&nbsp; Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute;.-&nbsp;&nbsp;&nbsp; Trẻ em từ 06 đến 11 tuổi mua 1/2 v&eacute;.-&nbsp;&nbsp;&nbsp;&nbsp; Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 1/2 v&eacute;.(Ti&ecirc;u chuẩn 1/2 v&eacute;: được 01 suất ăn + 01 ghế ngồi v&agrave; ngủ gh&eacute;p chung ph&ograve;ng với gia đ&igrave;nh).|NG&Agrave;Y 1: S&Agrave;I G&Ograve;N - SA Đ&Eacute;C - CAO L&Atilde;NH - TR&Agrave;M CHIM (220km) &nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: xe khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, Đồng Khởi, Nguyễn Huệ, L&ecirc; Lợi, Nguyễn Văn Linh, nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, nh&agrave; thờ Đức B&agrave;, nh&agrave; h&aacute;t Th&agrave;nh Phố, chợ Bến Th&agrave;nh, khu đ&ocirc; thị mới Ph&uacute; Mỹ Hưng. &nbsp;&nbsp; &nbsp;Theo quốc lộ 1A, du kh&aacute;ch chinh phục cầu treo Mỹ Thuận, cảm nhận vẻ đẹp dịu d&agrave;ng n&ecirc;n thơ của d&ograve;ng s&ocirc;ng Tiền. Tiếp tục theo quốc lộ 80, đo&agrave;n ngang qua những vườn c&acirc;y ăn tr&aacute;i xum xu&ecirc; như vươn hẳn ra ven đường vẫy gọi du kh&aacute;ch phương xa. &nbsp;&nbsp; &nbsp;Đến thị x&atilde; Sa Đ&eacute;c, xứ sở phố thị miền s&ocirc;ng nước, &ecirc;m đềm nhưng kh&ocirc;ng k&eacute;m vui tươi. Du kh&aacute;ch sẽ tham quan ch&ugrave;a cổ Kiến An Cung của người Hoa, chỉ cần bước qua hai con k&igrave; l&acirc;n bằng đ&aacute; xanh v&agrave;o cửa, du kh&aacute;ch sẽ cảm nhận được sự thanh tao v&agrave; lộng lẫy của nơi n&agrave;y, mỗi chi tiết kiến tr&uacute;c đều thể hiện độ tinh xảo của nghệ nh&acirc;n. Những ho&agrave;nh phi c&acirc;u đối, v&agrave; h&igrave;nh tượng được khắc nổi đều chứa đựng những ẩn &yacute; th&acirc;m s&acirc;u tượng trưng cho niềm tin cuộc sống. Du kh&aacute;ch như xua tan hết mọi phiền n&atilde;o của đời thường khi chi&ecirc;m b&aacute;i trước Quan Th&aacute;nh Đế Qu&acirc;n tuy uy nghi&ecirc;m nhưng rất gần gũi v&agrave; thi&ecirc;ng li&ecirc;ng. &nbsp;&nbsp; &nbsp;Rời ch&ugrave;a, du kh&aacute;ch sẽ đến với nh&agrave; cổ Huỳnh Thủy L&ecirc;, t&igrave;m hiểu kiến tr&uacute;c đặc sắc Đ&ocirc;ng - T&acirc;y h&ograve;a quyện, nghe thuyết minh về mối t&igrave;nh bất hủ giữa chủ nh&acirc;n ng&ocirc;i nh&agrave;, &ocirc;ng Huỳnh Thủy L&ecirc; (người Việt gốc Hoa) v&agrave; b&agrave; Marguerite Duras (người Ph&aacute;p). Chuyện t&igrave;nh l&atilde;ng mạn v&agrave; đẫm lệ n&agrave;y đ&atilde; được b&agrave; Marguerite kể lại trong cuốn tiểu thuyết Người T&igrave;nh, đ&atilde; dịch ra 43 thứ tiếng, sau đ&oacute; được chuyển thể th&agrave;nh bộ phim c&ugrave;ng t&ecirc;n Người T&igrave;nh, nổi tiếng khắp thế giới. &nbsp;&nbsp; &nbsp;Du kh&aacute;ch sẽ tiếp tục kh&aacute;m ph&aacute; l&agrave;ng hoa T&acirc;n Quy Đ&ocirc;ng, vườn hoa lớn nhất v&ugrave;ng T&acirc;y Nam Bộ. Du kh&aacute;ch sẽ đi bộ ngắm cảnh v&agrave; chi&ecirc;m ngưỡng&nbsp; h&agrave;ng trăm lo&agrave;i \" kỳ hoa dị thảo\" đua nhau khoe sắc khắp v&ugrave;ng cũng như h&ograve;a m&igrave;nh v&agrave;o khung cảnh mua b&aacute;n tr&ecirc;n bến dưới thuyền của L&agrave;ng hoa. &nbsp;&nbsp; &nbsp;Tiếp tục h&agrave;nh tr&igrave;nh xe đưa đo&agrave;n qua ph&agrave; Cao L&atilde;nh v&agrave;o th&agrave;nh phố Cao L&atilde;nh. Sau buổi cơm trưa, đo&agrave;n tham quan Vườn quốc gia Tr&agrave;m Chim Tam N&ocirc;ng, thuộc huyện Tam N&ocirc;ng, tỉnh Đồng Th&aacute;p. &nbsp;&nbsp; &nbsp;Đo&agrave;n sẽ c&oacute; dịp trải nghiệm cảm gi&aacute;c ch&ograve;ng ch&agrave;nh khi đi vỏ l&atilde;i lướt tr&ecirc;n s&oacute;ng nước xuy&ecirc;n những c&aacute;nh đồng l&uacute;a ma, xuy&ecirc;n rừng tr&agrave;m, xuy&ecirc;n những c&aacute;nh đồng Sen... Qu&yacute; kh&aacute;ch như h&ograve;a m&igrave;nh v&agrave;o thi&ecirc;n nhi&ecirc;n hoang d&atilde;, thỏa sức ngắm nh&igrave;n những sinh cảnh đặc biệt của Tr&agrave;m Chim theo m&ugrave;a như: -&nbsp;&nbsp; &nbsp;Th&aacute;ng 9 - 10 l&agrave; m&ugrave;a chim đẻ trứng, du kh&aacute;ch sẽ ngắm những tổ chim lơ lững tr&ecirc;n những c&agrave;nh tr&agrave;m, chim mẹ mớm mồi, chim con tập bay... -&nbsp;&nbsp; &nbsp;Th&aacute;ng 12 - 4 l&agrave; m&ugrave;a Sếu về: nếu may mắn Qu&yacute; kh&aacute;ch c&oacute; thể tận mắt thấy được Sếu Đầu Đỏ, lo&agrave;i chim thanh cao v&agrave; qu&yacute; hiếm nằm trong s&aacute;ch đỏ Việt Nam v&agrave; thế giới. -&nbsp;&nbsp; &nbsp;V&agrave; bất kỳ l&uacute;c n&agrave;o Qu&yacute; kh&aacute;ch cũng c&oacute; thể cảm nhận được m&ugrave;i của đồng qu&ecirc; với hoa tr&agrave;m, hoa s&uacute;ng, hoa sen; m&ugrave;i cỏ, m&ugrave;i năng, m&ugrave;i l&uacute;a ma... -&nbsp;&nbsp; &nbsp;Bất kỳ nơi n&agrave;o Qu&yacute; kh&aacute;ch cũng được h&ograve;a m&igrave;nh v&agrave;o m&ocirc;i trường sống hoang d&atilde; của h&agrave;ng chục lo&agrave;i c&aacute; đồng, h&agrave;ng trăm lo&agrave;i chim trời v&agrave; động vật hoang d&atilde; nơi đ&acirc;y... thỏa sức ngắm nh&igrave;n từng đ&agrave;n chim tr&iacute;ch đua nhau ra bờ k&ecirc;nh t&igrave;m mồi; từng đ&agrave;n Nhan Sen, Quốc lặn ngụp dưới nước để bắt c&aacute; v&agrave; nhiều nhiều cảnh quan sinh động kh&aacute;c của cuộc sống hoang d&atilde; nơi đ&acirc;y. &nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch d&ugrave;ng buổi chiều tại thị trấn Tr&agrave;m Chim với c&aacute;c m&oacute;n ăn d&acirc;n d&atilde; đặc trưng theo m&ugrave;a của v&ugrave;ng Đồng Th&aacute;p Mười như: lẩu ch&aacute;o lươn, c&aacute; tr&ecirc; nướng mắm gừng, canh chua c&aacute; l&oacute;c đồng, đi&ecirc;n điển x&agrave;o t&eacute;p... &nbsp;&nbsp; &nbsp;Đo&agrave;n về lại th&agrave;nh phố Cao L&atilde;nh nhận ph&ograve;ng nghỉ ngơi. Nghỉ đ&ecirc;m tại Cao L&atilde;nh. &nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa, chiều) &nbsp; NG&Agrave;Y 2: CAO L&Atilde;NH&nbsp; G&Aacute;O GIỒNG&nbsp; S&Agrave;I G&Ograve;N (196km)&nbsp; &nbsp;&nbsp;&nbsp; Buổi s&aacute;ng: sau khi d&ugrave;ng điểm t&acirc;m s&aacute;ng v&agrave; l&agrave;m thủ tục trả ph&ograve;ng, xe đưa đo&agrave;n khởi h&agrave;nh v&agrave;o Khu du lịch sinh th&aacute;i G&aacute;o Giồng thuộc huyện Cao L&atilde;nh, tỉnh Đồng Th&aacute;p. &nbsp;&nbsp;&nbsp; Xu&ocirc;i m&aacute;i ch&egrave;o tr&ecirc;n xuồng tam bản c&ugrave;ng c&aacute;c c&ocirc; g&aacute;i mặc &aacute;o b&agrave; ba xinh đẹp, du kh&aacute;ch tận hưởng khung cảnh chim trời c&aacute; nước m&ecirc;nh m&ocirc;ng, sen hồng phủ k&iacute;n mặt nước, rẽ từng cụm b&egrave;o c&aacute;m xanh ngắt len l&otilde;i tr&ecirc;n những con rạch nhỏ xuy&ecirc;n rừng tr&agrave;m v&agrave;o s&acirc;n chim, Qu&yacute; kh&aacute;ch sẽ tai nghe, mắt thấy h&agrave;ng trăm lo&agrave;i chim cư ngụ nơi đ&acirc;y. Du kh&aacute;ch sẽ l&ecirc;n đ&agrave;i quan s&aacute;t cao 18m, ngắm k&iacute;nh viễn vọng để cảm nhận một m&agrave;u xanh bất tận của rừng tr&agrave;m v&agrave; m&agrave;u trắng nhấp nh&ocirc; của h&agrave;ng ng&agrave;n con chim đủ loại đang sinh s&ocirc;i v&agrave; tr&uacute; ngụ nơi n&agrave;y. &nbsp;&nbsp;&nbsp; Thỏa sức với một chuyến kh&aacute;m ph&aacute; căng sức, Du kh&aacute;ch c&oacute; thể nghỉ ngơi tr&ecirc;n những chiếc v&otilde;ng mắc tr&ecirc;n nh&agrave; s&agrave;n đu đưa bởi những cơn gi&oacute; đồng nội, xa xa l&agrave; rừng tr&agrave;m, l&agrave; đồng năng v&agrave; những đ&agrave;n tr&iacute;ch đang t&igrave;m mồi; hoặc du kh&aacute;ch vừa nghỉ ngơi vừa c&acirc;u c&aacute;, c&aacute;i th&uacute; d&acirc;n d&atilde; th&ocirc;n qu&ecirc; nhưng kh&ocirc;ng k&eacute;m phần hấp dẫn, nhất l&agrave; buổi trưa Qu&yacute; kh&aacute;ch c&oacute; thể tận hưởng những th&agrave;nh quả do m&igrave;nh c&acirc;u được th&igrave; c&ograve;n g&igrave; th&uacute; vị cho bằng. Qu&yacute; kh&aacute;ch dung buổi trưa với những m&oacute;n ăn miệt đồng theo m&ugrave;a như; c&aacute; l&oacute;c nướng trui cặp l&aacute; sen non chấm nước mắm me, c&aacute; r&ocirc; kho tộ, c&aacute; linh nấu chua cơm mẻ với b&ocirc;ng s&uacute;ng... &nbsp;&nbsp;&nbsp; Buổi chiều: rời G&aacute;o Giồng, rời Đồng Th&aacute;p Mười - miệt qu&ecirc; d&acirc;n d&atilde; đậm chất Miền T&acirc;y, xe đưa đo&agrave;n theo quốc lộ 1A l&ecirc;n đường cao tốc S&agrave;i G&ograve;n - Trung Lương về lại S&agrave;i G&ograve;n. &nbsp;&nbsp;&nbsp; Về tới S&agrave;i G&ograve;n, chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch. &nbsp;&nbsp;&nbsp; (Ăn s&aacute;ng, trưa)|80|1'),(23,4,1,'VT|1 Day|Bus|Bus|Taxable Goods|Vũng Tàu|Friday|Monday|Saturday|Sunday|Thursday|Tuesday|Wednesday|GI&Aacute; V&Eacute; BAO GỒM :Xe đời mới c&oacute; m&aacute;y lạnh, đưa đ&oacute;n kh&aacute;ch đi theo chương tr&igrave;nh trong tour.Ăn uống theo chương tr&igrave;nh. Nếu kh&aacute;ch tự t&uacute;c ăn, v&eacute; tour được trừ lại: 150.000 VNĐHướng dẫn vi&ecirc;n thuyết minh v&agrave; phục vụ cho đo&agrave;n suốt tuyến.V&eacute; v&agrave;o cửa c&aacute;c thắng cảnh.Khăn lạnh, nước suối tr&ecirc;n đường&nbsp; (1 khăn, 1 chai/ ng&agrave;y).Qu&agrave; tặng, xổ số vui c&oacute; thưởng.Bảo hiểm du lịch theo qui định bảo hiểm Việt Nam với mức tối đa l&agrave; 60.000.000 VNĐ/trường hợp.GI&Aacute; V&Eacute; KH&Ocirc;NG BAO GỒM :Ghế, d&ugrave;, tắm nước ngọt.Ăn uống ngo&agrave;i chương tr&igrave;nh, v&agrave; c&aacute;c chi ph&iacute; vui chơi giải tr&iacute; tr&ecirc;n biển.GI&Aacute; V&Eacute; TRẺ EM:&nbsp;&nbsp;&nbsp;&nbsp;Trẻ em từ 12 tuổi trở l&ecirc;n mua 01 v&eacute; .Trẻ em từ 06 đến 11 tuổi mua 2/3 v&eacute;.Trẻ em từ 05 tuổi trở xuống: Kh&ocirc;ng t&iacute;nh v&eacute;, gia đ&igrave;nh tự lo cho b&eacute;. Nhưng 02 người lớn chỉ được k&egrave;m 01 trẻ em, nếu trẻ em đi k&egrave;m nhiều hơn th&igrave; từ em thứ 02 trở l&ecirc;n phải mua 2/3 v&eacute;. (Ti&ecirc;u chuẩn 2/3 v&eacute;: được 01 suất ăn + 01 ghế ngồi).|BUỔI S&Aacute;NG: S&Agrave;I G&Ograve;N - VŨNG T&Agrave;U &nbsp;&nbsp; &nbsp;Buổi s&aacute;ng: khởi h&agrave;nh từ Cung Văn H&oacute;a Lao Động TP.Hồ Ch&iacute; Minh, xe đưa du kh&aacute;ch đi theo lộ tr&igrave;nh Nguyễn Thị Minh Khai, L&ecirc; Duẩn, Đồng Khởi, Bạch Đằng, Nguyễn Hữu Cảnh... nơi c&oacute; những c&ocirc;ng tr&igrave;nh kiến tr&uacute;c văn h&oacute;a kết nối những th&agrave;nh tựu kinh tế của S&agrave;i G&ograve;n xưa v&agrave; nay như: Dinh Độc Lập, Nh&agrave; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n... Đo&agrave;n ăn s&aacute;ng tại qu&aacute;n cơm tấm Thuận Kiều. Đến Vũng T&agrave;u, Qu&yacute; kh&aacute;ch vui chơi tắm biển tại khu du lịch Biển Đ&ocirc;ng b&atilde;i Th&ugrave;y V&acirc;n (b&atilde;i sau). &nbsp; BUỔI CHIỀU: VŨNG T&Agrave;U&nbsp; S&Agrave;I G&Ograve;N &nbsp;&nbsp; &nbsp;Xe đưa đo&agrave;n đi theo con đường ven biển, qua b&atilde;i D&acirc;u, b&atilde;i Tầm Dương (b&atilde;i trước), Qu&yacute; kh&aacute;ch thưởng ngoạn phong cảnh n&ecirc;n thơ hữu t&igrave;nh của th&agrave;nh phố biển Vũng T&agrave;u, với 2 ngọn n&uacute;i lớn, n&uacute;i nhỏ kề b&ecirc;n biển. Tham quan Bạch Dinh, ngắm cảnh H&ograve;n B&agrave;. Đo&agrave;n dừng ở mũi Nghinh Phong chụp h&igrave;nh lưu niệm, ngắm tượng ch&uacute;a Gi&ecirc;su. &nbsp;&nbsp; &nbsp;Đo&agrave;n tiếp tục viếng Đại T&ugrave;ng L&acirc;m, gh&eacute; chợ B&agrave; Rịa mua đặc sản biển, v&agrave; khu b&ograve; sữa Long Th&agrave;nh mua c&aacute;c sản phẩm được l&agrave;m từ sữa b&ograve; tươi nguy&ecirc;n chất. &nbsp;&nbsp; &nbsp;Sau đ&oacute; đo&agrave;n khởi h&agrave;nh về TP.Hồ Ch&iacute; Minh theo cung đường Ng&atilde; ba C&aacute;t L&aacute;i - hầm Thủ Thi&ecirc;m, hầm vượt s&ocirc;ng d&agrave;i nhất Đ&ocirc;ng Nam &Aacute;. &nbsp;&nbsp; &nbsp;Về đến TP.Hồ Ch&iacute; Minh chia tay tạm biệt, hẹn t&aacute;i ngộ c&ugrave;ng Qu&yacute; kh&aacute;ch. &nbsp;&nbsp; &nbsp;(Ăn s&aacute;ng, trưa)|17|1'),(24,4,2,'VT|1 Day|B