e; thờ Đức B&agrave;, Nh&agrave; h&aacute;t Th&agrave;nh Phố, kh&aacute;ch sạn Caravelle, cầu Thủ Thi&ecirc;m, khu căn hộ cao cấp the Manor, cầu S&agrave;i G&ograve;n... Đến Th&agrave;nh phố Bảo Lộc - xứ sở của tr&agrave; v&agrave; c&agrave; ph&ecirc;, Qu&yacute; kh&aacute;ch d&ugrave;ng cơm trưa.&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Đo&agrave;n tiếp tục h&agrave;nh tr&igrave;nh đến địa phận huyện Đức Trọng xe đưa Qu&yacute; kh&aacute;ch v&agrave;o tham quan th&aacute;c Pongour hay c&ograve;n gọi l&agrave; th&aacute;c Bảy Tầng hoặc th&aacute;c Thi&ecirc;n Thai - l&agrave; một trong những ngọn th&aacute;c đẹp, hoang sơ v&agrave; h&ugrave;ng vỹ nhất khu vực Nam T&acirc;y Nguy&ecirc;n. &nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, đến Đ&agrave; Lạt, về kh&aacute;ch sạn Qu&yacute; kh&aacute;ch nhận ph&ograve;ng. &nbsp;&nbsp;&nbsp;&nbsp; Buổi tối, Qu&yacute; kh&aacute;ch đi dạo Đ&agrave; Lạt về đ&ecirc;m, thưởng thức c&aacute;c m&oacute;n ngon ở chợ đ&ecirc;m &Acirc;m Phủ, hương vị c&agrave; ph&ecirc; phố n&uacute;i ở qu&aacute;n Thủy Tạ, ngắm cảnh Hồ Xu&acirc;n Hương, nghỉ đ&ecirc;m tại Đ&agrave; Lạt. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(Ăn s&aacute;ng, trưa, chiều) NG&Agrave;Y 2 : Đ&Agrave; LẠT - C&Aacute;C THẮNG CẢNH &nbsp;&nbsp;&nbsp;&nbsp; Buổi s&aacute;ng, đo&agrave;n khởi h&agrave;nh đi tham quan L&agrave;ng hoa Th&aacute;i Phi&ecirc;n - một trong 3 l&agrave;ng nghề truyền thống trồng hoa nổi tiếng xứ cao nguy&ecirc;n, đến đ&acirc;y Qu&yacute; kh&aacute;ch kh&ocirc;ng chỉ được thỏa sức ngắm nh&igrave;n kh&ocirc;ng gian rực rỡ sắc hoa m&agrave; c&ograve;n c&oacute; thể quan s&aacute;t hoạt động canh t&aacute;c của c&aacute;c nghệ nh&acirc;n: người ươm giống, trồng c&acirc;y, chăm b&oacute;n, người thu h&aacute;i, bao g&oacute;i, đ&oacute;ng th&ugrave;ng sản phẩm; một kh&ocirc;ng gian thực m&agrave; rất thi vị. &nbsp;&nbsp;&nbsp;&nbsp; Tiếp tục đo&agrave;n đến tham quan Hồ Than Thở - nơi lưu dấu những địa danh l&atilde;ng mạn như: Đồi Th&ocirc;ng Hai Mộ, C&acirc;y Th&ocirc;ng T&igrave;nh Y&ecirc;u... để minh chứng cho t&igrave;nh y&ecirc;u bất diệt d&ugrave; đượm buồn nhưng son sắc thủy chung, đến đ&acirc;y Qu&yacute; kh&aacute;ch kh&ocirc;ng chỉ được tham quan những Di t&iacute;ch t&igrave;nh y&ecirc;u, những thắng cảnh thi&ecirc;n nhi&ecirc;n xinh đẹp m&agrave; c&ograve;n được nghe kể v&agrave; trải l&ograve;ng với những giai thoại, những chuyện t&igrave;nh l&acirc;m ly son sắc; sau đ&oacute; Qu&yacute; kh&aacute;ch di chuyển v&agrave;o Trang trại d&acirc;u Biofresh tham quan v&agrave; trải nghiệm phương thức trồng d&acirc;u mới theo c&ocirc;ng nghệ Ph&aacute;p, d&acirc;u trồng tr&ecirc;n gi&aacute; thể c&aacute;ch mặt đất 1m v&agrave; được chăm s&oacute;c theo quy tr&igrave;nh ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u cam kết kh&ocirc;ng sử thuốc trừ s&acirc;u bệnh độc hại. Tr&ecirc;n đường về nh&agrave; h&agrave;ng d&ugrave;ng cơm trưa, Qu&yacute; kh&aacute;ch dừng tham quan v&agrave; ngắm Rừng hoa kh&ocirc; - showroom hoa tươi bảo quản nghệ thuật lớn nhất Việt Nam. &nbsp;&nbsp;&nbsp;&nbsp; Buổi chiều, Qu&yacute; kh&aacute;ch tham quan Ph&acirc;n viện Sinh Học Đ&agrave; Lạt - nơi được xem như l&agrave; bảo t&agrave;ng của c&aacute;c lo&agrave;i động thực vật qu&yacute; hiếm. Đến đ&acirc;y 